[1879048666] = {["ID"] = 1879048666; ["i"] = 5; ["j"] = 1; ["k"] = 393; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 185; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "La Science de l'épée"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Ce livre, La Science de l’épée, ne semble pas être le genre d'ouvrages qui intéressent généralement les maîtres du savoir. Au lieu de plonger dans les mystères des montagnes ou de traiter des habitudes des vagues et du vent, il ressemble plus à un récit d'aventures écrit pour divertir les enfants hobbits. La Science de l’épée prétend conter les aventures d'une jeune maîtresse du savoir courageuse qui, confrontée au danger, réussissait toujours à s'en sortir grâce à un maniement de l'épée qui lui permettait de déstabiliser ses adversaires grâce à sa connaissance des éléments et son savoir d'une sagesse oubliée. Curieusement, alors que l'histoire commence à devenir passionnante, vous distinguez les nuances plus subtiles du conte se dévoiler à travers les yeux de son personnage principal, affichant une connaissance extraordinaire de la nature des ennemis qu'elle affronte, et une compréhension du moment opportun auquel la force des armes permet d'obtenir les meilleurs résultats. Malheureusement, cet exemplaire est en piteux état et plusieurs pages ont été déchirées ou sont illisibles. L'auteur lui-même reste un mystère, ayant choisi de s'identifier uniquement par la lettre runique 'G', inscrite sur la reliure"; ["SUMMARY"] = "Buy Lore of the Blade from a Lore-master Trainer and find the missing pages (8)"; };
[1879048669] = {["ID"] = 1879048669; ["i"] = 5; ["j"] = 1; ["k"] = 392; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 185; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Livre des monstres"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Il n'y a pas de nom sur ce livre et la clarté et la sagesse qui en ressortent ne font qu'ajouter au mystère de son auteur, manifestement d'une modestie exemplaire. Le Livre des monstres traite des liens pouvant être tissés entre des créatures sauvages et les Peuples Libres de la Terre du Milieu prêts à comprendre leur véritable nature. L'ouvrage indique en outre que les sages pourraient apprendre la langue des créatures sauvages et les pousser à accomplir des actes d'un courage et d'une force supérieurs à ceux dont elles seraient capable en temps normal. Malheureusement, la personne ayant transcrit cet exemplaire manquait manifestement de lucidité. Si la plupart du texte semble clair, certaines pages sont remplies de griffonnages indéchiffrables et incompréhensibles, ne ressemblant à aucune langue des Elfes ou des Hommes. On dirait que ce scribe a souffert de crises de démence au moment de la transcription de ces passages. Peut-être qu'Elrond de Fondcombe pourrait vous en dire plus sur l'auteur mystérieux et vous aider à déchiffrer les passages obscurs"; ["SUMMARY"] = "Buy The Book of Beasts from a Lore-master Trainer and find the missing pages (8)"; };
[1879048670] = {["ID"] = 1879048670; ["i"] = 5; ["j"] = 1; ["k"] = 391; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 185; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Des feuilles et des brindilles"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Voici un livre bien étrange... La couverture est réalisée à partir de bouts d'écorce suffisamment souples pour être tissés ensemble, et les pages semblent être faites de bouleau écrasé, couvertes de rangées denses de lettres runiques, page après page. Vous vous demandez par quelle magie un livre d'apparence si fragile a pu survivre ainsi au passage du temps. C'est aussi la première fois que vous voyez un livre d'une telle longueur, l'auteur abordant chaque sujet et chaque phrase avec tant de détails que vous ne pouvez imaginer le temps qu'il aura fallu pour tout écrire de cette façon. Le livre semble débattre de tout ce qui a trait aux arbres. Il contient tant d'informations concernant les racines, les feuilles, les écorces et les brindilles que vous pourriez l'étudier pendant des années sans jamais en venir à bout. Pour couronner le tout, quelqu'un en a arraché quelques pages, et vous vous demandez quels secrets celles-ci pouvaient bien renfermer. Peut-être le maître de la Dernière Maison Simple pourrait-il vous éclairer un peu... vous ne voyez pas qui d'autre"; ["SUMMARY"] = "Buy Of Leaf and Twig from a Lore-master Trainer and find the missing pages (8)"; };
[1879048690] = {["ID"] = 1879048690; ["i"] = 5; ["j"] = 1; ["k"] = 399; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 31; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Mélodies des Valar"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Les contes d'antan disent que le monde a pris forme au cours d'une grande chanson, mais en des temps si anciens que l'histoire est devenue mythe, même pour les plus vieux des Elfes encore en vie aujourd'hui... Personne sur la Terre du Milieu ne connaît la vérité à ce sujet. Vers la fin du Deuxième Age, pendant la Guerre de la Dernière Alliance, naquit une humaine d'une grande beauté qui chantait si merveilleusement, que même les Elfes s'arrêtaient pour l'écouter. Le plus étrange est qu'elle n'avait jamais appris la musique et savait pourtant composer des mélodies si belles qu'elles faisaient pleurer les puissants comme les sages. Elle prétendait qu'elle ne composait pas de chansons et qu'elle essayait simplement de reproduire une musique qu'elle entendait, une musique qui, selon elle, venait du monde lui-même, des montagnes, des rivières, du vent et des arbres, en des variétés infinies. Mélodies des Valar est le livre qui contient ces chansons telles que les Elfes les ont retranscrites, mais la plupart de ses exemplaires ont été emportés à l'Ouest et il en reste très peu sur la Terre du Milieu de nos jours. Malheureusement, cette copie est très abîmée, mais un ménestrel elfe de renom pourrait peut-être vous donner plus d'informations à son sujet,"; ["SUMMARY"] = "Buy Melodies of the Valar from a Minstrel Trainer and find the missing pages (8)"; };
[1879048691] = {["ID"] = 1879048691; ["i"] = 5; ["j"] = 1; ["k"] = 400; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 31; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "L'Accord montant"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. L'Accord montant est considéré comme une remarquable collection de chansons sur un thème parlant aux Peuples Libres de la Terre du Milieu d'une seule voix, qu'ils soient Hommes, Elfes ou nains. Epousant la tradition de chacun de ces peuples, les chansons résonnent d'un appel à la liberté et à l'espoir dans lequel on ne trouve aucune trace de souffrance, de crainte ou de haine. Certains prétendent qu'il s'agit là de chansons superficielles et sans réelle profondeur, mais les vrais ménestrels les voient comme des œuvres sans égal. Malheureusement, ce livre et les chansons qu'il renferme sont tombés en désuétude après la chute du Royaume du Nord, alors qu'une profonde léthargie et qu'un grand cynisme envahissaient les royaumes des Hommes et que les Elfes se renfermaient dans leurs bastions, au cœur de la forêt. 'De nos jours, il s'agit d'un livre rare... et les quelques exemplaires que l'on trouve encore sont généralement incomplets, comme celui-ci. Peut-être le célèbre ménestrel elfe Lindir pourrait-il vous en dire plus à ce sujet"; ["SUMMARY"] = "Buy The Rising Chord from a Minstrel Trainer and find the missing pages (8)"; };
[1879048692] = {["ID"] = 1879048692; ["i"] = 5; ["j"] = 1; ["k"] = 401; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 31; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Les Marches du courage"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Les Marches du courage... Le titre même du livre que vous tenez entre les mains vous fait frissonner. Sa couverture tombe en poussière, mais la reliure est quasiment intacte, imprégnée de la même ferveur martiale que les mélodies contenues dans l'ouvrage. Il s'agit là d'un des rares exemplaires ayant survécu à la chute du royaume de Numénor, arrivé dans des circonstances improbables en Terre du Milieu, où il était caché depuis des siècles. Bien qu'écrites en Sindarin, ces chansons sont celles des nobles royaumes des Hommes. Mais quoi qu'il en soit, elles parlent à tous ceux qui doivent se battre, invoquant des visions d'armées en marche, dans des fracas de voix et d'acier. Dans les mains d'un ménestrel, ces chansons martiales offrent un aperçu intéressant du fonctionnement du cœur du guerrier et de la façon dont il peut être éveillé en cas de besoin. Ah, si seulement le volume que vous tenez entre les mains était plus complet... Il manque beaucoup de chansons. Peut-être que Lindir de Fondcombe pourra vous aider à combler les trous"; ["SUMMARY"] = "Buy Valour's Marches from a Minstrel Trainer and find the missing pages (8)"; };
[1879048703] = {["ID"] = 1879048703; ["i"] = 5; ["j"] = 1; ["k"] = 367; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 40; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Livre des couteaux"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Le Livre des couteaux a été écrit par une cambrioleuse très célèbre - on dit même d'elle qu'elle aurait volé le plus beau joyau d'un trésor sous les griffes d'un dragon endormi – mais personne ne connaît son véritable nom et beaucoup doutent de la véracité de ses exploits. Quoi qu'il en soit, elle était connue, en son temps, comme l'une des meilleures combattantes au couteau de la Terre du Milieu. Hélas, le Livre des couteaux est incomplet et souvent si sibyllin qu'il est difficile d'en apprendre grand-chose. Le célèbre cambrioleur Bilbon Sacquet est réputé pour son amour des énigmes et des mystères. Peut-être serait-il en mesure de déchiffrer une partie de ce texte."; ["SUMMARY"] = "Buy The Book of Knives from a Burglar Trainer and find the missing pages (8)"; };
[1879048704] = {["ID"] = 1879048704; ["i"] = 5; ["j"] = 1; ["k"] = 366; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 40; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Manuel de Brise-Rotule"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Le Manuel de Brise-Rotule est un livre étrange, car il semble avoir été rédigé de façon précise et méticuleuse, alors qu'il décrit un individu particulièrement rustre et sauvage. Quoi qu'il en soit, les exploits décrits dans cet ouvrage penchent du côté le plus sombre de la profession de cambrioleur et l'auteur du livre présente un certain nombre de points très intrigants. Malheureusement, il manque plusieurs pages importantes. On dit que le célèbre cambrioleur Bilbon Sacquet a entrepris d'étudier ce livre depuis qu'il a pris sa retraite. Il aura peut-être des informations à vous donner sur ce 'Brise-Rotule' ou sur les parties manquantes ?"; ["SUMMARY"] = "Buy Knee-breaker's Manual from a Burglar Trainer and find the missing pages (8)"; };
[1879048705] = {["ID"] = 1879048705; ["i"] = 5; ["j"] = 1; ["k"] = 368; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 40; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Guide de l'expert en combat irrégulier"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Le Guide de l'expert en combat irrégulier relate les hauts faits d'un cambrioleur hobbit notoire, au milieu du Troisième Age, quand la Comté n'était pas aussi sûre qu'elle l'est aujourd'hui. Ce personnage, s'étant retrouvé engagé dans le Rassemblement de la Comté lors d'une saison particulièrement difficile et ayant affronté les gobelins de Golfimbul dans un certain nombre de batailles rangées, a appris à se battre d'une façon tout à fait non-orthodoxe qui lui a bien servi contre des ennemis considérablement plus grands et plus forts que lui. Malheureusement, il s'est passé de nombreuses années depuis que ce livre passionnant a été écrit et l'on croyait tous les exemplaires existants perdus... jusqu'à présent. Peut-être le célèbre cambrioleur hobbit Bilbon Sacquet pourrait-il vous en dire plus sur cet ouvrage."; ["SUMMARY"] = "Buy The Expert's Guide to Dirty Fighting from a Burglar Trainer and find the missing pages (8)"; };
