[1879052485] = {["ID"] = 1879052485; ["i"] = 5; ["j"] = 1; ["k"] = 386; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 162; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Flèches dans les ténèbres"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Ce journal a été écrit par un chasseur qui semble avoir passé beaucoup de temps seul, quelque part près des frontières ouest de la Forêt Noire, au-delà des Monts Brumeux, là où peu d'Hommes vivent et où les gobelins pullulent. Sans alliés et entourés d'ennemis, il a appris à se servir de l'incertitude et de la peur comme armes pour déstabiliser ses ennemis alors qu'il s'efforçait de survivre dans cette région périlleuse. N'ayant personne à qui parler, il a décidé de raconter sa vie et ses expériences par écrit. Ce journal est très abîmé et déchiré par endroits -peut-être par ces mêmes gobelins que le chasseur prétend avoir souvent vaincus- et de nombreux passages importants ont disparu. Un autre chasseur de renom pourrait peut-être vous aider à mieux comprendre ce livre original. On dit que Legolas de la Forêt Noire se trouve en Eriador pour une mission importante"; ["SUMMARY"] = "Buy A Shot in the Dark from a Hunter Trainer and find the missing pages (8)"; };
[1879052486] = {["ID"] = 1879052486; ["i"] = 5; ["j"] = 1; ["k"] = 388; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 162; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Livre des chasseurs"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Vous avez déjà entendu parler de ce livre... On dit qu'il a été rédigé par des chasseurs elfes chargés de garder la ville secrète de Gondolin, prise par les forces des ténèbres au Premier Age. Les auteurs de cette œuvre sont morts depuis longtemps et de nombreuses copies de l'ouvrage ont été réalisées, mais bon nombre de ces dernières ont été transcrites par des Hommes à partir de livres plus anciens et sont inexactes, laissant de côté plusieurs points importants. Cet exemplaire semble pourtant assez précis. Il a probablement été retranscrit par des scribes elfes de Fondcombe ou de la Lórien... mais malheureusement, plusieurs pages en ont été arrachées. Legolas, l'Elfe, pourrait peut-être vous aider à ce sujet"; ["SUMMARY"] = "Buy The Way of the Hunter from a Hunter Trainer and find the missing pages (8)"; };
[1879052487] = {["ID"] = 1879052487; ["i"] = 5; ["j"] = 1; ["k"] = 387; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 162; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "La Charge lointaine"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. La Charge lointaine fut rédigée par un capitaine du Gondor ayant participé à un combat malencontreux peu avant la Guerre de la Dernière Alliance. Au cours de ce combat, les forces du jeune royaume du Gondor se retrouvèrent face à une compagnie de chasseurs elfes de la Lórien, les deux camps ayant été piégés par l'Ennemi, déterminé à saper l'alliance qui finirait par le renverser. Dans ce livre, le capitaine décrit une attaque vaillante mais sans espoir des Hommes du Gondor contre les Elfes, bataille au cours de laquelle ils subirent une terrible volée de flèches tombant du ciel et pétrifiant les hommes les plus braves, piégés sous une pluie sans fin de bois et de métal. La Charge lointaine est considérée comme une œuvre importante sur le pouvoir du chasseur dans les grands combats ayant défini la face de la Terre du Milieu d'aujourd'hui. Malheureusement, le temps a fait son œuvre et cet exemplaire est très abîmé. Peut-être Legolas de la Forêt Noire, dont on dit qu'il se trouve en Eriador, pourrait-il vous aider à comprendre ce livre"; ["SUMMARY"] = "Buy The Furthest Charge from a Hunter Trainer and find the missing pages (8)"; };
[1879053012] = {["ID"] = 1879053012; ["i"] = 5; ["j"] = 1; ["k"] = 372; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 24; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "La Flamme de la bougie"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. La Flamme de la bougie est une œuvre passionnante rédigée par l'un des grands capitaines du Gondor lors de la Guerre de la Dernière Alliance. Le livre traite des liens très particuliers qu'un bon capitaine forme avec ses troupes et de l'importance de ces liens lorsqu'un guerrier se trouve au seuil de la mort. Il n'existe plus beaucoup d'exemplaires de cet ouvrage de nos jours, la plupart ayant été perdus au fil du temps ou cachés dans les bibliothèques secrètes des Seigneurs du Gondor. Plusieurs pages importantes manquent dans cet exemplaire de la Flamme de la bougie. Si l'on en croit les rumeurs, Boromir, capitaine du Gondor, est arrivé récemment dans le Nord. Il pourra peut-être vous aider à comprendre ce livre."; ["SUMMARY"] = "Buy The Candle's Flame from a Captain Trainer and find the missing pages (8)"; };
[1879053013] = {["ID"] = 1879053013; ["i"] = 5; ["j"] = 1; ["k"] = 373; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 24; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Le Traité du courage"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Le Traité du courage a été écrit par un conseil de capitaines commandant autrefois Fornost, la grande forteresse de l'ancien royaume d'Arnor à l'apogée de sa puissance. On dit qu'il s'agissait de la clé de voûte des principes de commandement et d'art de la guerre pour les soldats d'Arnor et que ce livre contenait des informations et des enseignements qui permirent de repousser les attaques d'Angmar aussi longtemps que le Royaume du Nord résista. On croyait tous les exemplaires restants du Traité perdus ou brûlés lors de la mise à sac de Fornost. Bon nombre des pages du Traité du courage ont été déchirées ou brûlées, ce qui rend le livre quasiment illisible. Peut-être que Boromir du Gondor, arrivé récemment dans le Nord, aura des informations sur cet ouvrage."; ["SUMMARY"] = "Buy Treatise of Valour from a Captain Trainer and find the missing pages (8)"; };
[1879053014] = {["ID"] = 1879053014; ["i"] = 5; ["j"] = 1; ["k"] = 371; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 24; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Livre des serments"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Le Livre des Serments traite du rôle central de l'honneur en matière de commandement et du caractère sacré du serment d'un roi ou d'un capitaine. Une bonne partie du pouvoir de commander dérive de la Vérité elle-même et, pour ceux qui commandent, un serment est un engagement ne pouvant être brisé sans que cela ait des conséquences catastrophiques. Un capitaine trahissant ses propres paroles risquerait plus que la mort, car un véritable serment engage bien plus que l'enveloppe charnelle. On dit de ce livre qu'il s'agit de l'autorité en la matière, mais l'exemplaire que vous avez trouvé a l'air bien abîmé et il manque bon nombre de passages importants. Peut-être que Boromir du Gondor, qui se trouve actuellement dans le Nord, aurait des informations à vous donner concernant cet ouvrage."; ["SUMMARY"] = "Buy The Book of Oaths from a Captain Trainer and find the missing pages (8)"; };
[1879059839] = {["ID"] = 1879059839; ["i"] = 5; ["j"] = 1; ["k"] = 378; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 172; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Le Livre des épées"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Rédigé dans un Sindarin méticuleux, le Livre des épées est connu depuis longtemps comme l'un des meilleurs manuels concernant le maniement de l'épée et le combat. Il fut écrit dans les premiers âges de la Terre du Milieu et il en existait de nombreux exemplaires, mais presque tous disparurent ou furent modifiés peu après la fin du Deuxième Age. En conséquence, la plupart des exemplaires existant de nos jours sont incomplets. L'exemplaire que vous avez trouvé semble presqu'intact, mais le temps et l'usage ont fait le travail de ceux qui souhaitaient limiter les informations contenues dans ce livre : il manque certaines pages et d'autres sont illisibles. Peut-être que Gimli, fils de Gloïn du Mont Solitaire, pourrait vous en dire plus à ce sujet."; ["SUMMARY"] = "Buy The Tome of Swords from a Champion Trainer and find the missing pages (8)"; };
[1879059840] = {["ID"] = 1879059840; ["i"] = 5; ["j"] = 1; ["k"] = 377; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 172; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "La Beauté du combat"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. La Beauté du combat est un titre tout-à-fait approprié pour ce livre écrit par un grand champion nain à l'apogée du règne de Durin à Khazad-dûm. Ce n'est pas un simple traité sur l'art du combat comme il en existe beaucoup. Non, c'est plutôt un traité philosophique décrivant la perspective de l'auteur concernant l'art de la guerre et du combat, et la façon dont il a fini par y trouver une méditation et une transcendance qu'il ne pouvait ressentir qu'au beau milieu des épées qui s'entrechoquaient et des cris sur les champs de bataille. Ce n'est pas un livre pour les pleutres ou les faibles, mais il semble curieusement écrit dans un style soutenu et son ton ne reflète pas la folie meurtrière à laquelle le lecteur pourrait s'attendre au vu du titre. Malheureusement, le temps a fait son œuvre et il manque de nombreuses de pages dans cet exemplaire. Gimli le nain pourra peut-être vous en dire plus sur la Beauté du combat, étant donné que le livre a été rédigé par l'un de ses ancêtres"; ["SUMMARY"] = "Buy The Joy of Battle from a Champion Trainer and find the missing pages (8)"; };
[1879059841] = {["ID"] = 1879059841; ["i"] = 5; ["j"] = 1; ["k"] = 376; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 172; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Vous avez découvert La Lame de l'artisan"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Au vu du titre, vous vous disiez que ce livre avait probablement été écrit par un Elfe (et il est en effet écrit en Sindarin), mais l'auteur semble en réalité être un champion d'une ancienne lignée de Numénor, avant la fondation d'Arnor. Le livre est si ancien que certaines pages menacent de tomber en poussière entre vos mains. Le dialecte est ancien et difficile à déchiffrer, et l'auteur montre une approche du combat à l'épée assez inhabituelle, mettant l'accent sur la répétition et la concentration des mouvements les plus basiques. Il suggère une concentration sur le contrôle et le pouvoir absolus, qui permet de découvrir la finesse et l'art. Ce livre pourrait constituer un manuel d'entraînement très précieux s'il ne manquait pas tous ces passages clés... Peut-être que Gimli le nain pourrait vous en dire plus"; ["SUMMARY"] = "Buy The Artisan Blade from a Champion Trainer and find the missing pages (8)"; };
[1879060151] = {["ID"] = 1879060151; ["i"] = 5; ["j"] = 1; ["k"] = 382; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 23; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "La Meilleure défense"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Ce livre a été écrit en tant qu'abécédaire de l'art du gardien vers le milieu du Troisième Age, pendant la période difficile qui a suivi la chute de Khazad-dûm. A cette époque, le Peuple de Durin était éparpillé et largement diminué, et le rôle du gardien prit une importance plus grande, alors que l'intérêt des gobelins et des Orques pour les camps souterrains des nains devenait de plus en plus menaçant. Les nains construisaient souvent de puissants bastions conçus pour empêcher quiconque d'approcher leurs villes et pour résister aux attaques. Ces forts abritaient des gardiens compétents dont la mission consistait à protéger la ville. C'est un livre assez commun, mais le propriétaire de cet exemplaire a griffonné de nombreuses notes en marge des pages, révélant une expérience et des connaissances manifestement largement supérieures à celles de l'auteur du livre. Malheureusement, l'ouvrage est abîmé et bon nombre de pages manquent. Peut-être quelqu'un connaissant bien cet art pourrait vous donner l'identité de la personne qui a griffonné ces notes et vous indiquer où trouver le reste des pages"; ["SUMMARY"] = "Buy The Best Defence from a Guardian Trainer and find the missing pages (8)"; };
[1879060152] = {["ID"] = 1879060152; ["i"] = 5; ["j"] = 1; ["k"] = 381; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 23; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "La Chanson d'une vierge guerrière"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. La Chanson d'une vierge guerrière a été rédigée il y a de nombreuses années de cela et raconte l'histoire d'une vierge guerrière du Rohan. Ces filles étaient rarement appelées à se battre, mais elles recevaient néanmoins un entraînement rigoureux dans les arts du combat, aussi rigoureux que celui de leurs homologues masculins. Ce livre raconte l'histoire d'une d'entre elles qui s'est retrouvée à se battre de façon inattendue et qui, tout en s'efforçant de défendre son seigneur, chanta d'une voix divine une magnifique chanson de guerre. Sa voix était si puissante que les Orques qui se trouvaient en face d'elle ne la virent pas comme une faible femme mais comme un grand guerrier terrifiant. Malheureusement, vous ne parvenez pas à savoir comment se termine l'histoire, et de nombreux autres détails manquent, car le livre est très abîmé. Vous trouverez peut-être quelqu'un à Fondcombe qui saurait ce qu'il en est"; ["SUMMARY"] = "Buy A Shield-maiden's Song from a Guardian Trainer and find the missing pages (8)"; };
[1879060153] = {["ID"] = 1879060153; ["i"] = 5; ["j"] = 1; ["k"] = 383; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 23; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Le Dernier mot"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Ce livre d'origine elfique a été rédigé il y a si longtemps que très peu des Elfes d'aujourd'hui étaient nés à l'époque. Il semble impossible de deviner l'âge de l'ouvrage, car il ne présente aucun signe d'usure. Vous ne connaissez ni le type de parchemin sur lequel il a été rédigé, ni d'encre capable de résister ainsi au passage du temps. La seule indication de son âge et de son origine se trouve dans le style employé, qui utilise des lettres très anciennes appelées Tengwar, écriture créée par les Noldors il y a plusieurs millénaires de cela. Le livre est difficile à traduire, mais il semble parler d'un ancien serment de combat que des gardiens elfes pouvaient prêter au cœur d'une bataille désespérée, serment qui les liait, eux et leurs ennemis, dans un pacte de combat et de mort que personne n'osait violer. D'après le texte, il est clair que ces serments étaient plus puissants qu'un simple cri de guerre... mais le secret de la technique semble perdu, plusieurs pages importantes ayant été déchirées par une personne voulant sans doute protéger ses secrets, il y a fort longtemps de cela. Peut-être qu'à Fondcombe, quelqu'un pourra vous aider à déchiffrer ce livre"; ["SUMMARY"] = "Buy The Final Word from a Guardian Trainer and find the missing pages (8)"; };
