[1879073460] = {["ID"] = 1879073460; ["i"] = 5; ["j"] = 2; ["k"] = 34; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 81; ["LP"] = 5; ["TIER"] = 2; ["MIN_LVL"] = 13; ["NAME"] = "Ennemi / Ennemie des loups"; ["LORE"] = "Les loups sont depuis longtemps un véritable fléau pour le peuple de la Comté. Lorsque l'hiver est rude, ils descendent parfois du Nord en meutes pour s'attaquer au bétail et menacer les hobbits eux-mêmes. Depuis quelque temps, il semblerait qu'ils soient de plus en plus nombreux dans le Sud, et certains disent que ce sont les gobelins, voire des forces encore plus sinistres, qui les commandent."; ["SUMMARY"] = "Defeat 50 Wolves in any area"; };
[1879073461] = {["ID"] = 1879073461; ["i"] = 5; ["j"] = 2; ["k"] = 33; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 81; ["LP"] = 10; ["TIER"] = 1; ["MIN_LVL"] = 19; ["NAME"] = "Ennemi / Ennemie des loups II"; ["LORE"] = "Bien que les loups soient souvent hostiles, la plupart des gens les considèrent comme des prédateurs dangereux, mais sans plus. Cependant, depuis quelque temps, ils arrivent du Nord en énormes meutes, et ils n'ont pas l'air d'être juste à la recherche de nourriture. Si l'on en croit les rumeurs, bon nombre de ces meutes furent élevées par les gobelins au Nord et entraînées pour attaquer les Hommes, les hobbits et les troupeaux qui approvisionnent en nourriture la plupart des villes d'Eriador."; ["SUMMARY"] = "Defeat 100 Wolves in any area"; };
[1879073462] = {["ID"] = 1879073462; ["i"] = 5; ["j"] = 2; ["k"] = 32; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 81; ["LP"] = 15; ["MIN_LVL"] = 25; ["NAME"] = "Ennemi / Ennemie des loups III"; ["LORE"] = "On raconte qu'à l'époque du vieux Taureau Mugissant, l'arrivée des gobelins de Golfimbul fut précédée d'une invasion de loups similaire à celle qui se produit actuellement. Ça ne peut pas être un bon signe."; ["SUMMARY"] = "Defeat 150 Wolves in any area"; };
[1879073463] = {["ID"] = 1879073463; ["i"] = 5; ["j"] = 2; ["k"] = 37; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 81; ["LP"] = 5; ["TIER"] = 2; ["MIN_LVL"] = 13; ["NAME"] = "Ennemi / Ennemie des araignées"; ["LORE"] = "Bien qu'aucun hobbit qui se respecte n'ait jamais vraiment 'fréquenté' les araignées, depuis quelque temps, de nouvelles races bien plus imposantes semblent avoir vu le jour et migré par ici à partir des montagnes qui se trouvent à l'est. Pour une raison inconnue, ces sales créatures semblent avoir beaucoup d'animosité envers les hobbits, compliquant ainsi beaucoup la vie des Petites Gens vivant à la frontière de la Comté ou un peu plus loin."; ["SUMMARY"] = "Defeat 50 Spiders in any area"; };
[1879073464] = {["ID"] = 1879073464; ["i"] = 5; ["j"] = 2; ["k"] = 36; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 81; ["LP"] = 10; ["TIER"] = 1; ["MIN_LVL"] = 29; ["NAME"] = "Ennemi / Ennemie des araignées II"; ["LORE"] = "Mais d'où viennent ces horribles créatures ? Où sont passées les gentilles petites araignées qui dévoraient les mouches ? Ces temps-ci, les araignées font au minimum deux pieds, et parfois bien plus que ça... et ce n'est franchement pas ce que vous vous attendriez à rencontrer dans la Comté, mais elles sont à présent partout dans les forêts d'Eriador. De quoi interloquer le plus placide des hobbits. Il se passe vraiment des choses étranges."; ["SUMMARY"] = "Defeat 100 Spiders in any area"; };
[1879073465] = {["ID"] = 1879073465; ["i"] = 5; ["j"] = 2; ["k"] = 35; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 81; ["LP"] = 15; ["MIN_LVL"] = 35; ["NAME"] = "Ennemi / Ennemie des araignées III"; ["LORE"] = "Quand vous étiez jeune, on vous avez raconté une vieille légende elfique concernant une énorme araignée qui avait tenté de dévorer toute la lumière du monde. Elle avait été chassée et avait disparu pour toujours, mais ses petits avaient continué à se multiplier dans des endroits sombres et terrifiants. Vous vous souvenez que cette histoire vous faisait frissonner chaque fois que vous l'entendiez... mais avec tout ce que vous avez pu voir ces derniers temps, vous vous demandez si elle n'avait pas un fond de vérité, finalement...."; ["SUMMARY"] = "Defeat 250 Spiders in any area"; };
[1879073466] = {["ID"] = 1879073466; ["i"] = 5; ["j"] = 2; ["k"] = 39; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 81; ["LP"] = 5; ["TIER"] = 1; ["MIN_LVL"] = 29; ["NAME"] = "Ennemi / Ennemie des gobelins"; ["LORE"] = "De toutes les créatures au service de l'Ennemi, les gobelins sont les seuls à avoir ouvertement attaqué la Comté. Ils furent éliminés par Touque, le Taureau Mugissant, il y a fort longtemps de cela, mais les descendants de Golfimbul ont été repérés non loin de votre beau pays, ainsi que dans plusieurs autres endroits au Nord. Les hobbits doivent de nouveau prendre les armes, et les Frontaliers ont redoublé d'efforts afin de ne pas être pris par surprise par ces créatures sauvages."; ["SUMMARY"] = "Defeat 100 Goblins in any area"; };
[1879073467] = {["ID"] = 1879073467; ["i"] = 5; ["j"] = 2; ["k"] = 38; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 81; ["LP"] = 10; ["MIN_LVL"] = 35; ["NAME"] = "Ennemi / Ennemie des gobelins II"; ["LORE"] = "On dirait que la Comté aura bientôt besoin d'un nouveau Taureau Mugissant, car les gobelins ont de nouveau envahi le pays. Les limites de la Comté ne sont plus sûres, et quand vous imaginez votre peuple paisible et pacifique face à ces horribles créatures... Il va falloir faire quelque chose, et vite, pour empêcher cela."; ["SUMMARY"] = "Defeat 150 Goblins in any area"; };
[1879073506] = {["ID"] = 1879073506; ["i"] = 5; ["j"] = 2; ["k"] = 42; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 23; ["LP"] = 5; ["TIER"] = 2; ["MIN_LVL"] = 13; ["NAME"] = "Ennemi / Ennemie des Morts"; ["LORE"] = "Depuis l'aube des temps, des esprits malfaisants, dont les Balrogs du Mordor ne sont pas les moindres, sillonnent le royaume des ombres au service de l'Ennemi. Leurs ignobles sortilèges leur permettent de ranimer les ossements des Hommes défunts, qu'ils transforment en redoutables êtres spectraux. Pour la race des Hommes, qui considèrent que l'âme des morts passe dans l'au-delà, ces esprits sont une véritable abomination."; ["SUMMARY"] = "Defeat 50 Dead in any area"; };
[1879073507] = {["ID"] = 1879073507; ["i"] = 5; ["j"] = 2; ["k"] = 41; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 23; ["LP"] = 10; ["TIER"] = 1; ["MIN_LVL"] = 19; ["NAME"] = "Ennemi / Ennemie des Morts II"; ["LORE"] = "On raconte que, quand le Roi-Sorcier arriva en Angmar, il exerça sa volonté sur de nombreux esprits malfaisants de Morgoth, qu'il envoya envahir les Hauts des Galgals qui se dressent non loin de Bree, dernier bastion des Rôdeurs du Cardolan. Au Troisième Âge, plus rien n'y vit... à l'exception de ces êtres spectraux."; ["SUMMARY"] = "Defeat 100 Dead in any area"; };
[1879073508] = {["ID"] = 1879073508; ["i"] = 5; ["j"] = 2; ["k"] = 40; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 23; ["LP"] = 15; ["MIN_LVL"] = 25; ["NAME"] = "Ennemi / Ennemie des Morts III"; ["LORE"] = "Morgoth, Sauron, le Roi-Sorcier d'Angmar, les terrifiants Seigneurs décharnés... tous ont le pouvoir de permettre à des esprits démoniaques au service de l'Ennemi de posséder les ossements des défunts. La rumeur fait état de vals hantés du royaume d'Angmar qui ne seraient occupés que par ces esprits malfaisants et les terribles êtres spectraux auxquels ils donnent naissance...."; ["SUMMARY"] = "Defeat 150 Dead in any area"; };
[1879073509] = {["ID"] = 1879073509; ["i"] = 5; ["j"] = 2; ["k"] = 45; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 23; ["LP"] = 5; ["TIER"] = 2; ["MIN_LVL"] = 13; ["NAME"] = "Ennemi / Ennemie des ouargues"; ["LORE"] = "Les ouargues sont considérés comme un fléau par les hommes, car ils s'attaquent aux troupeaux et au bétail desquels dépendent tant de villages de la Terre du Milieu. Ils sont à cet effet bien plus dangereux que les loups, car les ouargues massacrent le bétail même une fois leur faim rassasiée et laissent ainsi pourrir des troupeaux entiers."; ["SUMMARY"] = "Defeat 50 Wargs in any area"; };
[1879073510] = {["ID"] = 1879073510; ["i"] = 5; ["j"] = 2; ["k"] = 44; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 23; ["LP"] = 10; ["TIER"] = 1; ["MIN_LVL"] = 29; ["NAME"] = "Ennemi / Ennemie des ouargues II"; ["LORE"] = "Les gobelins se servent parfois des ouargues comme montures pour étendre la portée de leurs attaques contre les villages et les campements. Les gobelins, en effet, n'aiment pas aller se battre trop loin, car il faut qu'ils aient le temps de retourner dans leurs grottes avant le lever du soleil."; ["SUMMARY"] = "Defeat 150 Wargs in any area"; };
[1879073511] = {["ID"] = 1879073511; ["i"] = 5; ["j"] = 2; ["k"] = 43; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 23; ["LP"] = 15; ["MIN_LVL"] = 35; ["NAME"] = "Ennemi / Ennemie des ouargues III"; ["LORE"] = "Personne ne connaît la nature exacte de la relation existant entre les gobelins et les ouargues. Certains disent qu'ils sont alliés contre des ennemis communs, tandis que d'autres pensent que les gobelins élèvent ces créatures pour la guerre. Ces deux hypothèses ont sans doute un fond de vérité... il est possible que jadis les gobelins élevaient les ouargues, qui réussirent à s'échapper pour créer leurs propres meutes sous la direction des plus intelligents de leur race... et que ces meutes continuent à travailler avec les gobelins par commodité."; ["SUMMARY"] = "Defeat 250 Wargs in any area"; };
[1879073512] = {["ID"] = 1879073512; ["i"] = 5; ["j"] = 2; ["k"] = 47; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 23; ["LP"] = 5; ["TIER"] = 1; ["MIN_LVL"] = 29; ["NAME"] = "Ennemi / Ennemie des Montagnards"; ["LORE"] = "Depuis longtemps, il existe des tribus d'Hommes qui refusent d'obéir à des rois et de vivre dans les grandes cités. Certains d'entre eux sont les alliés des Hommes du Gondor ou du Rohan, mais beaucoup tombent sous le joug de l'Ennemi, qui profite de leur méfiance envers les grands royaumes, les menace ou leur fait miroiter richesses et pouvoirs illusoires. Ainsi, les royaumes de la Terre du Milieu se sont souvent trouvés en guerre contre le peuple des montagnes lorsque l'Ennemi se réveille, et il semble que ce sera encore le cas cette fois."; ["SUMMARY"] = "Defeat 150 Hillmen in any area"; };
[1879073513] = {["ID"] = 1879073513; ["i"] = 5; ["j"] = 2; ["k"] = 46; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 23; ["LP"] = 10; ["MIN_LVL"] = 35; ["NAME"] = "Ennemi / Ennemie des Montagnards II"; ["LORE"] = "Apparemment, ce sont de vieilles superstitions et la crainte des terrifiants pouvoirs de l'Ennemi qui poussent ces Montagnards à rejoindre ses rangs... superstition et peur semées il y a très longtemps dans le cœur des Hommes par le Seigneur Ténébreux, afin de disposer de serviteurs le moment venu. Depuis longtemps, la liberté des Hommes les sert et les dessert à la fois... Ils sont les seuls à pouvoir choisir leur destin, et ce n'est pas toujours une bonne chose...."; ["SUMMARY"] = "Defeat 250 Hillmen in any area"; };
[1879073549] = {["ID"] = 1879073549; ["i"] = 5; ["j"] = 2; ["k"] = 20; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 65; ["LP"] = 5; ["TIER"] = 2; ["MIN_LVL"] = 13; ["NAME"] = "Ennemi / Ennemie des gobelins"; ["LORE"] = "Les gobelins furent créés il y a fort longtemps de cela par Morgoth qui tortura des Elfes prisonniers et les transforma en monstres, éternels ennemis de leurs anciens frères. Tout ce qui était bon en eux fut transformé en mal et les Elfes essaient depuis des siècles de les éradiquer de la Terre du Milieu, en vain."; ["SUMMARY"] = "Defeat 50 Goblins in any area"; };
[1879073550] = {["ID"] = 1879073550; ["i"] = 5; ["j"] = 2; ["k"] = 19; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 65; ["LP"] = 10; ["TIER"] = 1; ["MIN_LVL"] = 19; ["NAME"] = "Ennemi / Ennemie des gobelins II"; ["LORE"] = "Les gobelins sont des monstres, façonnés par l'Ennemi pour le servir sans poser de questions, une réserve de soldats inépuisable. Fort heureusement, ces créatures n'ont aucune imagination et ne sont pas très douées au combat, ce qui en fait des proies faciles pour les guerriers elfes bien entraînés. Mais elles sont si nombreuses... et même si un seul Elfe tombe pour cent gobelins tués, c'est toujours une grande perte."; ["SUMMARY"] = "Defeat 100 Goblins in any area"; };
[1879073551] = {["ID"] = 1879073551; ["i"] = 5; ["j"] = 2; ["k"] = 18; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 65; ["LP"] = 15; ["MIN_LVL"] = 25; ["NAME"] = "Ennemi / Ennemie des gobelins III"; ["LORE"] = "On ne sait pas trop ce que les gobelins pensent des Elfes, car il est très rare qu'ils daignent aborder ce sujet, sauf bien sûr du bout d'une pique ou d'une lance. Sont-ils même conscients de leurs liens passés, de l'époque où ils vivaient parmi les Peuples Libres ? Haïssent-ils les Elfes parce que leur Seigneur Ténébreux le leur demande, ou parce qu'ils ont quelques souvenirs de cette époque lointaine et qu'ils veulent vous détruire par pure jalousie ?"; ["SUMMARY"] = "Defeat 150 Goblins in any area"; };
[1879073552] = {["ID"] = 1879073552; ["i"] = 5; ["j"] = 2; ["k"] = 23; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 65; ["LP"] = 5; ["TIER"] = 2; ["MIN_LVL"] = 13; ["NAME"] = "Ennemi / Ennemie des Orques"; ["LORE"] = "Elevés par l'Ennemi pour la guerre, les Orques sont plus grands et plus robustes que leurs cousins gobelins, mais leurs origines sont les mêmes. Brutaux et militarisés, ils ont un certain talent pour le travail du bois et du métal, dont ils se servent uniquement pour la construction d'armes et de machines de guerre."; ["SUMMARY"] = "Defeat 50 Orcs in any area"; };
[1879073553] = {["ID"] = 1879073553; ["i"] = 5; ["j"] = 2; ["k"] = 22; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 65; ["LP"] = 10; ["TIER"] = 1; ["MIN_LVL"] = 29; ["NAME"] = "Ennemi / Ennemie des Orques II"; ["LORE"] = "A la différence des gobelins, les Orques ont été élevés uniquement pour la guerre et forment la base des armées de l'Ennemi. Ils ne sont ni lâches, ni faibles. Certes, ils ne seront jamais aussi forts que les Elfes, mais leur force numérique et leur ingéniosité lorsqu'il s'agit de créer des machines de guerre constituent des avantages certains lorsqu'ils sont motivés par les seigneurs des ténèbres."; ["SUMMARY"] = "Defeat 100 Orcs in any area"; };
[1879073554] = {["ID"] = 1879073554; ["i"] = 5; ["j"] = 2; ["k"] = 21; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 65; ["LP"] = 15; ["MIN_LVL"] = 35; ["NAME"] = "Ennemi / Ennemie des Orques III"; ["LORE"] = "Même si les Orques détestent presque autant le soleil que les gobelins, ils le tolèrent mieux et peuvent l'endurer pendant un certain temps en cas de nécessité ou si leurs maîtres les y forcent. Ceci dit, l'Ennemi invoque régulièrement d'énormes nuages de fumée ou de ténèbres pour protéger ses troupes des rayons du soleil et masquer ses mouvements."; ["SUMMARY"] = "Defeat 250 Orcs in any area"; };
[1879073555] = {["ID"] = 1879073555; ["i"] = 5; ["j"] = 2; ["k"] = 25; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 65; ["LP"] = 5; ["TIER"] = 1; ["MIN_LVL"] = 29; ["NAME"] = "Ennemi / Ennemie des drakes"; ["LORE"] = "Les dragons furent créés il y a fort longtemps de cela pour enrayer le pouvoir des Elfes au Nord, et ils y arrivèrent grâce à leur puissance et leur intelligence, fers de lance implacable des armées de l'Ennemi. Tout comme les Elfes, les dragons n'ont jamais été très nombreux, et ils sont si sauvages que leur progéniture atteint rarement l'âge adulte. Ils sont eux aussi moins nombreux en Terre du Milieu, mais depuis quelque temps, bon nombre de drakes sont venus d'Angmar... ce qui est très préoccupant, car si ces monstres inférieurs ont réapparu, les dragons ne sont certainement pas loin derrière ! Le danger est grand, mais ces créatures doivent absolument être détruites !"; ["SUMMARY"] = "Defeat 100 Drakes in any area"; };
[1879073556] = {["ID"] = 1879073556; ["i"] = 5; ["j"] = 2; ["k"] = 24; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 65; ["LP"] = 10; ["MIN_LVL"] = 35; ["NAME"] = "Ennemi / Ennemie des drakes II"; ["LORE"] = "Même s'ils ne disposent que d'une fraction du pouvoir des dragons, les drakes sont extrêmement dangereux. Même parmi les Premiers-Nés, c'est une marque d'honneur de vaincre une telle créature. Personne ne sait d'où viennent ces monstres... Comment l'Ennemi a-t-il réussi à créer ces horreurs ? A partir de quelle créature ? Même les Elfes ignorent tout des origines des drakes."; ["SUMMARY"] = "Defeat 150 Drakes in any area"; };
[1879073586] = {["ID"] = 1879073586; ["i"] = 5; ["j"] = 2; ["k"] = 12; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 73; ["LP"] = 5; ["TIER"] = 2; ["MIN_LVL"] = 13; ["NAME"] = "Ennemi / Ennemie des Poings bourrus"; ["LORE"] = "Les nains Poings bourrus semblent avoir tourné le dos aux Peuples Libres de la Terre du Milieu et se sont rebellés contre les Longues Barbes, leurs chefs légitimes."; ["SUMMARY"] = "Defeat 50 Dourhand in any area"; };
[1879073587] = {["ID"] = 1879073587; ["i"] = 5; ["j"] = 2; ["k"] = 11; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 73; ["LP"] = 10; ["TIER"] = 1; ["MIN_LVL"] = 19; ["NAME"] = "Ennemi / Ennemie des Poings bourrus II"; ["LORE"] = "Jaloux du statut et de la richesse des Longues Barbes, surtout depuis que le Peuple de Durin a repris le Mont Solitaire, les Poings bourrus essaient depuis des années de les renverser et de s'approprier le rôle de chefs des nains des Montagnes Bleues."; ["SUMMARY"] = "Defeat 100 Dourhand in any area"; };
[1879073588] = {["ID"] = 1879073588; ["i"] = 5; ["j"] = 2; ["k"] = 10; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 73; ["LP"] = 15; ["MIN_LVL"] = 25; ["NAME"] = "Ennemi / Ennemie des Poings bourrus III"; ["LORE"] = "La trahison et la tragédie ont toujours fait partie intégrante de l'histoire. La rébellion des Poings bourrus constitue le dernier chapitre en date de cette terrible litanie. Il est grand temps de clore enfin ce chapitre...."; ["SUMMARY"] = "Defeat 150 Dourhand in any area"; };
[1879073589] = {["ID"] = 1879073589; ["i"] = 5; ["j"] = 2; ["k"] = 15; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 73; ["LP"] = 5; ["TIER"] = 2; ["MIN_LVL"] = 13; ["NAME"] = "Ennemi / Ennemie des gobelins"; ["LORE"] = "Les gobelins et les nains se méprisent depuis toujours. Ce sont des ennemis naturels à la fois à la surface de la terre et en dessous, les innombrables gobelins se heurtant année après année aux défenses infatigables des nains, à la manière de vagues venant se fracasser inlassablement contre des rochers."; ["SUMMARY"] = "Defeat 50 Goblins in any area"; };
[1879073590] = {["ID"] = 1879073590; ["i"] = 5; ["j"] = 2; ["k"] = 14; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 73; ["LP"] = 10; ["TIER"] = 1; ["MIN_LVL"] = 29; ["NAME"] = "Ennemi / Ennemie des gobelins II"; ["LORE"] = "Les nains ont toujours eu l'avantage sur les gobelins en termes d'aptitude au combat, et disposent depuis toujours d'armes, d'armures et de fortifications supérieures. Les gobelins, eux, ont toujours eu l'avantage du nombre, ce qui est loin d'être négligeable."; ["SUMMARY"] = "Defeat 100 Goblins in any area"; };
[1879073591] = {["ID"] = 1879073591; ["i"] = 5; ["j"] = 2; ["k"] = 13; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 73; ["LP"] = 15; ["MIN_LVL"] = 35; ["NAME"] = "Ennemi / Ennemie des gobelins III"; ["LORE"] = "En groupe, les gobelins sont assez étranges. Si on les prend un par un, ce sont des lâches qui fuient tout individu leur paraissant plus fort qu'eux, mais en groupe, ils ont l'habitude de se jeter sans réfléchir contre les piques et les haches, avec beaucoup de sauvagerie. On dit que lorsqu'ils sont très nombreux, les gobelins se trouvant en première ligne n'ont pas le choix, car ils sont poussés en avant par tous leurs frères derrière eux, et se battent donc comme des animaux pris au piège. D'après ce que vous avez pu voir, il y a sans doute un fond de vérité là-dedans."; ["SUMMARY"] = "Defeat 250 Goblins in any area"; };
[1879073592] = {["ID"] = 1879073592; ["i"] = 5; ["j"] = 2; ["k"] = 17; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 73; ["LP"] = 5; ["TIER"] = 1; ["MIN_LVL"] = 29; ["NAME"] = "Ennemi / Ennemie des trolls"; ["LORE"] = "Les trolls constituent une menace particulièrement importante pour les nains. Capables de détruire les fortifications les plus solides, et vivant dans de sombres domaines souterrains où le soleil ne pose aucun danger, ils ont souvent été utilisés comme fer de lance lors des grandes attaques lancées contre les royaumes des nains."; ["SUMMARY"] = "Defeat 100 Trolls in any area"; };
[1879073593] = {["ID"] = 1879073593; ["i"] = 5; ["j"] = 2; ["k"] = 16; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 73; ["LP"] = 10; ["MIN_LVL"] = 35; ["NAME"] = "Ennemi / Ennemie des trolls II"; ["LORE"] = "A l'opposé des gobelins, la plupart des trolls sont assez stupides. Ils sont toutefois d'une grande témérité et n'hésitent pas à écraser tout ce qui se trouve sur leur chemin. Ils ne se rebellent pas, sauf s'ils sont gravement blessés... et la vision d'un troll des cavernes se déchaînant contre ses maîtres gobelins est un spectacle apprécié de tous, même les plus endurcis des vétérans."; ["SUMMARY"] = "Defeat 150 Trolls in any area"; };
[1879084435] = {["ID"] = 1879084435; ["i"] = 6; ["j"] = 10; ["k"] = 3; ["TYPE"] = 3; ["VXP"] = 4000; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879091341; ["TIER"] = 2; ["MIN_LVL"] = 30; ["NAME"] = "Bastions d'espoir"; ["LORE"] = "Même dans les déserts d'Angmar, il reste quelques petits bastions de résistance et de courage qui s'efforcent de combattre les ténèbres. Cachés et bien défendus dans les collines de ce sombre pays, ces avant-postes et ces camps offrent leur aide à ceux qui désirent se battre contre les pouvoirs de Carn Dûm."; ["SUMMARY"] = "Find 5 outposts of the Free People"; };
[1879085025] = {["ID"] = 1879085025; ["i"] = 6; ["j"] = 10; ["k"] = 4; ["TYPE"] = 3; ["VXP"] = 2000; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879091341; ["TIER"] = 2; ["MIN_LVL"] = 30; ["NAME"] = "Le cercle du désespoir"; ["LORE"] = "On dit que l'ancienne forteresse du Roi-Sorcier d'Angmar est entourée de huit tours terrifiantes dans lesquelles résidaient ses lieutenants lors de la longue guerre contre l'Arnor. C'est là qu'ils pratiquaient leur magie et jetaient leurs sorts maléfiques sur les forces de l'Ouest."; ["SUMMARY"] = "Find 8 towers of Despair"; };
[1879085026] = {["ID"] = 1879085026; ["i"] = 6; ["j"] = 10; ["k"] = 5; ["TYPE"] = 3; ["VXP"] = 4000; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879091341; ["TIER"] = 2; ["MIN_LVL"] = 30; ["NAME"] = "La route de la guerre"; ["LORE"] = "Il y a une grande route qui traverse les déserts d'Angmar et qui mène aux portes de Carn Dûm. C'est sur cette route que les armées des ténèbres avancent pour faire tomber les Peuples Libres d'Eriador sous le joug de l'Ennemi."; ["SUMMARY"] = "Find 5 locations on the path to Carn Dum"; };
[1879086558] = {["ID"] = 1879086558; ["i"] = 5; ["j"] = 3; ["k"] = 3; ["TYPE"] = 6; ["LP"] = 20; ["TIER"] = 1; ["NAME"] = "Les Ombres d'Angmar"; ["LORE"] = "Découvrez l’histoire épique des Ombres d’Angmar."; ["SUMMARY"] = "Complete Epic Vol. I, Book I through Vol. I, Book VIII."; ["TITLE"] = "Lumière de l'Ombre"; };
[1879086561] = {["ID"] = 1879086561; ["i"] = 6; ["j"] = 9; ["k"] = 10; ["TYPE"] = 7; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 300; ["FACTION"] = 1879091343; ["TIER"] = 3; ["NAME"] = "Voyageur / Voyageuse d'Evendim"; ["LORE"] = "La terre d'Evendim, ancienne capitale de l'Arnor, le Royaume du Nord, n'est plus habitée depuis longtemps par les Hommes, exception faite de quelques bandes de pillards opérant dans les ruines et tombeaux qui bordent le grand lac. Et alors que les armées du Nord se préparent une nouvelle fois à la guerre, ceux qui prendront le contrôle de l'ancienne capitale du temps jadis y gagneront peut-être un avantage déterminant dans le conflit à venir."; ["SUMMARY"] = "Complete 30 quests in Evendim"; };
[1879086562] = {["ID"] = 1879086562; ["i"] = 6; ["j"] = 9; ["k"] = 9; ["TYPE"] = 7; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 500; ["FACTION"] = 1879091343; ["TIER"] = 2; ["NAME"] = "Pèlerin / Pèlerine d'Evendim"; ["LORE"] = "Au temps jadis, le Royaume d'Arnor s'est scindé en factions rivales sous l'influence malfaisante d'Angmar. Perdant presque toute son influence, la capitale, Annuminas, fut finalement abandonnée. On la reconstruisit à Fornost, qui devint pour un temps le siège de la monarchie de l'Arthedain."; ["SUMMARY"] = "Complete 60 quests in Evendim"; };
[1879086563] = {["ID"] = 1879086563; ["i"] = 6; ["j"] = 9; ["k"] = 8; ["TYPE"] = 7; ["VXP"] = 2000; ["LP"] = 15; ["REP"] = 700; ["FACTION"] = 1879091343; ["TIER"] = 1; ["NAME"] = "Gardien / Gardienne d'Evendim"; ["LORE"] = "Même s'il n'y a ni industrie ni agriculture ni même le moindre bastion d'importance stratégique à Evendim, les Hommes du Nord pourraient voir comme un symbole majeur la renaissance de la grande capitale d'Annuminas sous la bannière des anciens rois."; ["SUMMARY"] = "Complete 90 quests in Evendim"; };
[1879086861] = {["ID"] = 1879086861; ["i"] = 6; ["j"] = 9; ["k"] = 19; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879091343; ["TIER"] = 3; ["MIN_LVL"] = 20; ["NAME"] = "Défenseur / Défenseuse des tombeaux"; ["LORE"] = "Depuis bien longtemps, les ruines d'Annuminas et les tombeaux des rois d'antan sont la proie de nombreux pilleurs de tombes. Les rôdeurs s'allient avec tous ceux qui prennent les armes pour lutter contre ces gredins."; ["SUMMARY"] = "Defeat 90 Tomb-robbers in Evendim"; ["TITLE"] = "Gardien / Gardienne de tombeau"; };
[1879086862] = {["ID"] = 1879086862; ["i"] = 6; ["j"] = 9; ["k"] = 18; ["TYPE"] = 4; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879091343; ["TIER"] = 2; ["MIN_LVL"] = 20; ["NAME"] = "Défenseur / Défenseuse des tombeaux (avancé)"; ["LORE"] = "Ceux qui osent profaner les tombeaux des anciens Dunedain s'enhardissent de plus en plus à mesure que le chaos et la terreur s'étendent dans le Nord. Prendre les armes contre de tels malfaisants est l'une des plus nobles causes qui soient."; ["SUMMARY"] = "Defeat 180 Tomb-robbers in Evendim"; };
[1879086863] = {["ID"] = 1879086863; ["i"] = 6; ["j"] = 9; ["k"] = 21; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879091343; ["TIER"] = 3; ["MIN_LVL"] = 20; ["NAME"] = "Tueur / Tueuse de Limrafn"; ["LORE"] = "Les Limrafn sont une forme d'esprits malfaisants de faible puissance. Nul, pas même les Elfes, ne sait ce qui les attire en si grand nombre à Evendim."; ["SUMMARY"] = "Defeat 50 Limrafn in Evendim"; ["TITLE"] = "Gardien / Gardienne des mystères"; };
[1879086864] = {["ID"] = 1879086864; ["i"] = 6; ["j"] = 9; ["k"] = 20; ["TYPE"] = 4; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879091343; ["TIER"] = 2; ["MIN_LVL"] = 20; ["NAME"] = "Tueur / Tueuse de Limraf (avancé)"; ["LORE"] = "Vous avez affronté un grand nombre de ces étranges lueurs d'Evendim, récemment, à croire que la présence des Hommes et d'autres forces les encourage à se multiplier. Se pourrait-il que ces étranges entités soient créées ou attirées par les affrontements qui se multiplient dans cette contrée, autrefois vide et désolée ?"; ["SUMMARY"] = "Defeat 100 Limrafn in Evendim"; };
[1879086865] = {["ID"] = 1879086865; ["i"] = 6; ["j"] = 9; ["k"] = 23; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879091343; ["TIER"] = 3; ["MIN_LVL"] = 30; ["NAME"] = "Tueur / Tueuse de Gauradans"; ["LORE"] = "Les légendes évoquent depuis longtemps l'existence des loups-garous et, depuis que votre route a croisé celle des Gauradans, vous commencez à attribuer une part de véracité à ces improbables récits. Si ces créatures sont assimilables aux Hommes, ce n'est qu'à peine. Plus grands que les Hommes, ils avancent voûtés et leur langage comme leurs outils sont extrêmement primitifs. Le plus souvent, ils sont vêtus de peaux de loup."; ["SUMMARY"] = "Defeat 90 Gauradain in Evendim"; ["TITLE"] = "Tueur / Tueuse de Gauradans"; };
[1879086866] = {["ID"] = 1879086866; ["i"] = 6; ["j"] = 9; ["k"] = 22; ["TYPE"] = 4; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879091343; ["TIER"] = 2; ["MIN_LVL"] = 30; ["NAME"] = "Tueur / Tueuse de Gauradans (avancé)"; ["LORE"] = "Si les Gauradans étaient connus du temps des anciens rois d'Arnor, rares sont les récits qui parlent encore d'eux. Il est plus probable que ces semi-Hommes sauvages ont rejoint Evendim depuis le lointain nord et Forochel."; ["SUMMARY"] = "Defeat 180 Gauradain in Evendim"; };
[1879086867] = {["ID"] = 1879086867; ["i"] = 6; ["j"] = 9; ["k"] = 25; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879091343; ["TIER"] = 3; ["MIN_LVL"] = 30; ["NAME"] = "Tueur de géants / Tueuse de géants"; ["LORE"] = "Une tribu de géants des pierres semble s'être installée dans les collines qui surplombent Evendim à l'ouest. Bien que moins impressionnants que leurs légendaires cousins des Monts Brumeux, ils sont extrêmement dangereux quand ils se mettent en colère, surtout pour les soldats isolés."; ["SUMMARY"] = "Defeat 40 Giants in Evendim"; ["TITLE"] = "Ennemi / Ennemie des géants"; };
[1879086868] = {["ID"] = 1879086868; ["i"] = 6; ["j"] = 9; ["k"] = 24; ["TYPE"] = 4; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879091343; ["TIER"] = 2; ["MIN_LVL"] = 20; ["NAME"] = "Tueur de géants / Tueuse de géants (avancé)"; ["LORE"] = "Nul ne sait à qui les géants sont alliés. En fait, il semblerait qu'ils sont trop capricieux pour voir autre chose que leur propre intérêt. Néanmoins, si cette contrée venait à passer sous le contrôle de l'Ennemi, nul doute que les géants seraient forcés de le servir et qu'ils deviendraient l'un de ses plus redoutables corps d'armée."; ["SUMMARY"] = "Defeat 80 Giants in Evendim"; };
[1879086869] = {["ID"] = 1879086869; ["i"] = 6; ["j"] = 9; ["k"] = 27; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879091343; ["TIER"] = 3; ["MIN_LVL"] = 20; ["NAME"] = "Tueur de gobelins / Tueuse de gobelins"; ["LORE"] = "De nos jours, les gobelins sont devenus un fléau universel, puisqu'ils sont même présents en bordure de la Comté. Selon la rumeur, il en existerait une nouvelle race à Evendim, sous la forme des étranges boggarts, créatures sournoises qui chassent leur proie en meute."; ["SUMMARY"] = "Defeat 90 Goblins in Evendim"; ["TITLE"] = "Adversaire des gobelins"; };
[1879086870] = {["ID"] = 1879086870; ["i"] = 6; ["j"] = 9; ["k"] = 26; ["TYPE"] = 4; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879091343; ["TIER"] = 2; ["MIN_LVL"] = 20; ["NAME"] = "Tueur de gobelins / Tueuse de gobelins (avancé)"; ["LORE"] = "Il semblerait que les gobelins ne sont pas encore nombreux au sud d'Evendim. Peut-être ont-ils seulement pour mission de harceler les habitants de la Comté et de détourner l'attention des rôdeurs d'objectifs plus importants ? Quoi qu'il en soit, ces créatures creusent des galeries pour échapper à la vigilance des sentinelles et surgir en grand nombre, et ainsi semer le chaos chez ceux qui ne s'attendent pas à leur assaut."; ["SUMMARY"] = "Defeat 180 Goblins in Evendim"; };
[1879086871] = {["ID"] = 1879086871; ["i"] = 6; ["j"] = 9; ["k"] = 29; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879091343; ["TIER"] = 3; ["MIN_LVL"] = 30; ["NAME"] = "Tueur de Kergrims / Tueuse de Kergrims"; ["LORE"] = "Les Kergrims sont un autre mystère d'Evendim. Les rôdeurs semblent penser qu'ils sont de lointains cousins des bêtes des neiges qui rôdent dans les Monts Brumeux, mais nul ne sait ce qu'ils font ici, ni ce qui les a transformés de la sorte. Il est logique de se dire que l'Ennemi y est pour quelque chose, mais rien ne permet d'en apporter la preuve."; ["SUMMARY"] = "Defeat 50 Kergrim in Evendim"; ["TITLE"] = "Fléau des Kergrims"; };
[1879086872] = {["ID"] = 1879086872; ["i"] = 6; ["j"] = 9; ["k"] = 28; ["TYPE"] = 4; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879091343; ["TIER"] = 2; ["MIN_LVL"] = 30; ["NAME"] = "Tueur de Kergrims / Tueuse de Kergrims (avancé)"; ["LORE"] = "Nombre de Kergrims infestent la vallée regroupant les tombeaux de nombreux rois dunedain. Nul doute que la profanation de ce lieu sacré pour les rôdeurs du Nord ne mette ces derniers dans une rage folle, mais ils sont trop peu nombreux pour envoyer du monde chasser ces créatures."; ["SUMMARY"] = "Defeat 100 Kergrim in Evendim"; };
[1879086873] = {["ID"] = 1879086873; ["i"] = 6; ["j"] = 9; ["k"] = 31; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879091343; ["TIER"] = 3; ["MIN_LVL"] = 20; ["NAME"] = "Tueur de salamandres / Tueuse de salamandres"; ["LORE"] = "Rares sont ceux qui peuvent se vanter d'avoir aperçu les salamandres d'Evendim. Ces lointaines cousines des dragons ont une grande affinité pour le feu, qu'elles utilisent contre tous les êtres qui viennent troubler leur quiétude."; ["SUMMARY"] = "Defeat 90 Salamanders in Evendim"; ["TITLE"] = "Némésis des flammes"; };
[1879086874] = {["ID"] = 1879086874; ["i"] = 6; ["j"] = 9; ["k"] = 30; ["TYPE"] = 4; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879091343; ["TIER"] = 2; ["MIN_LVL"] = 20; ["NAME"] = "Tueur de salamandres / Tueuse de salamandres (avancé)"; ["LORE"] = "Bizarrement, les salamandres vivent souvent à proximité d'importants plans d'eaux ou cours d'eau, comme des lacs ou des fleuves, quand elles ne résident pas au cœur des marécages ou des déserts chauds. Les érudits pensent que cela est dû au fait que la végétation brûle au contact de ces créatures, lesquelles ne peuvent vivre que dans les endroits dénués de toute verdure ou, au contraire, suffisamment humides pour éteindre les feux qu'elles déclenchent involontairement."; ["SUMMARY"] = "Defeat 180 Salamanders in Evendim"; };
[1879089144] = {["ID"] = 1879089144; ["i"] = 6; ["j"] = 9; ["k"] = 5; ["TYPE"] = 3; ["VXP"] = 2000; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879091343; ["TIER"] = 2; ["MIN_LVL"] = 30; ["NAME"] = "Les tombeaux d'Evendim"; ["LORE"] = "Les rois d'Annuminas étaient enterrés dans des tombeaux longeant la route menant aux portes de la ville. Neuf rois gouvernèrent l'Arnor depuis la cité, mais tous ne furent pas ensevelis dans la Voie des Rois..."; ["SUMMARY"] = "Find 8 tombs of the Dunedain kings"; };
