[1879089146] = {["ID"] = 1879089146; ["i"] = 6; ["j"] = 9; ["k"] = 6; ["TYPE"] = 3; ["VXP"] = 2000; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879091343; ["TIER"] = 2; ["MIN_LVL"] = 30; ["NAME"] = "Contrées sauvages d'Evendim"; ["LORE"] = "Ancienne capitale du Nord, Evendim a toujours été synonyme de régions sauvages et de profonds mystères... qui sont respectivement devenus plus dangereuses et plus épais depuis l'abandon d'Annuminas. Loin au-delà des eaux du lac Evendim s'étendent des terres que l'Homme n'a plus explorées depuis longtemps."; ["SUMMARY"] = "Find 8 locations in the wilds of Evendim"; };
