[1879093967] = {["ID"] = 1879093967; ["i"] = 6; ["j"] = 3; ["k"] = 22; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 700; ["FACTION"] = 1879091408; ["TIER"] = 1; ["MIN_LVL"] = 40; ["NAME"] = "Fléau des Traîtres"; ["LORE"] = "Les ruines des nains de Sarnur ont été découvertes et occupées par les Poings bourrus, qui comptent s'en faire une base d'où frapper les Longues Barbes. Pire, ils se sont alliés avec les créatures malfaisantes et corrompues qui ont prêté allégeance au pouvoir d'Angmar. Vous devez vous attaquer aux Poings bourrus dans les rues défoncées de Sarnur avant qu'ils regroupent leurs forces et trouvent courage dans les forces envoyées par l'Angmar."; ["SUMMARY"] = "Defeat 80 Dourhand dwarves in Sarnúr"; ["TITLE"] = "Fléau des Traîtres"; };
