[1879099039] = {["ID"] = 1879099039; ["i"] = 6; ["j"] = 8; ["k"] = 3; ["TYPE"] = 3; ["VXP"] = 2000; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879091346; ["TIER"] = 2; ["MIN_LVL"] = 30; ["NAME"] = "Les Hauteurs repoussantes"; ["LORE"] = "Même si la plupart des gens restent chez eux et s'occupent des champs et des boutiques, certains aventuriers hardis sont attirés par les endroits les plus inhospitaliers et les plus hostiles de la Terre du Milieu. Pour tester les individus les plus solides, peu de lieux sont aussi hostiles que les Monts Brumeux qui entourent la région du Haut Col, elle-même remplie de dangers, naturels ou non."; ["SUMMARY"] = "Find 8 mountain peaks in the Misty Mountains"; };
[1879099040] = {["ID"] = 1879099040; ["i"] = 6; ["j"] = 8; ["k"] = 4; ["TYPE"] = 3; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 500; ["FACTION"] = 1879091346; ["TIER"] = 2; ["MIN_LVL"] = 30; ["NAME"] = "Gobelinville"; ["LORE"] = "Peu de gens connaissent les profondeurs de Gobelinville. Et ceux qui les ont fréquentés comme esclaves des cruels surveillants gobelins y ont probablement péri. Les gobelins eux-mêmes ne connaissent pas forcément tous les chemins, car les passages les plus profonds s'étendent jusqu'au cœur des Monts Brumeux où sont tapies des créatures horribles et inconnues. Les gobelins refusent de s'y engager, à moins d'y être forcés ou d'être fous de rage."; ["SUMMARY"] = "Find 7 areas in Goblin Town"; };
