[1879109787] = {["ID"] = 1879109787; ["i"] = 6; ["j"] = 11; ["k"] = 4; ["TYPE"] = 3; ["VXP"] = 2000; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879103954; ["TIER"] = 2; ["MIN_LVL"] = 30; ["NAME"] = "Pierres anciennes du Forochel"; ["LORE"] = "Les Lossoth du Forochel ne sont pas de grands bâtisseurs, mais, il y a longtemps, les nains avaient construit de nombreux campements et mines dans le Nord."; ["SUMMARY"] = "Find 5 ancient structures in Forochel"; };
[1879109788] = {["ID"] = 1879109788; ["i"] = 6; ["j"] = 11; ["k"] = 7; ["TYPE"] = 7; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 300; ["FACTION"] = 1879103954; ["TIER"] = 3; ["NAME"] = "Expédition dans le Forochel"; ["LORE"] = "Les Lossoth du Forochel sont engagés dans une lutte permanente contre leurs ennemis les Gauradans, contre les animaux sauvages du Nord et contre les éléments eux-mêmes. On pourrait donc s'attendre à ce qu'ils accueillent généreusement toute aide extérieure, mais cette vie dans la difficulté leur a fait développer un fort sentiment d'indépendance. Les rallier à la cause des Peuples Libres d'Eriador s'annonce donc être une tâche des plus difficile."; ["SUMMARY"] = "Complete 10 quests in Forochel"; };
[1879109789] = {["ID"] = 1879109789; ["i"] = 6; ["j"] = 11; ["k"] = 6; ["TYPE"] = 7; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 500; ["FACTION"] = 1879103954; ["TIER"] = 2; ["NAME"] = "Survie dans le Forochel"; ["LORE"] = "Dans le Forochel, le plus grand danger est la rigueur des éléments naturels. Les vents froids et la glace font plus de victimes que les griffes des kalpa-kita ou les lances des Gauradans, bien que la différence soit ténue."; ["SUMMARY"] = "Complete 20 quests in Forochel"; };
[1879109790] = {["ID"] = 1879109790; ["i"] = 6; ["j"] = 11; ["k"] = 5; ["TYPE"] = 7; ["VXP"] = 2000; ["LP"] = 15; ["REP"] = 700; ["FACTION"] = 1879103954; ["TIER"] = 1; ["NAME"] = "Pionnier / Pionnière du Forochel"; ["LORE"] = "Les étendues sauvages et inhospitalières du Forochel incitent les moins téméraires à ne pas s'y engager, mais ceux qui ont le courage et l'envie de se mesurer à la force des éléments ne peuvent pas longtemps résister à son appel."; ["SUMMARY"] = "Complete 30 quests in Forochel"; };
[1879109791] = {["ID"] = 1879109791; ["i"] = 6; ["j"] = 11; ["k"] = 10; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879103954; ["TIER"] = 3; ["MIN_LVL"] = 30; ["NAME"] = "Tueur d'Angmarim / Tueuse d'Angmarim"; ["LORE"] = "Ainsi, l'ombre d'Angmar s'étend jusqu'aux paysages désolés du Forochel, semant les graines de la discorde et de la guerre comme à son habitude... Pourtant, sa présence semble moins puissante ici qu'ailleurs... ou peut-être la région n'est-elle pas d'un intérêt suffisant, l'Angmar ne pouvant compter ici que sur ses alliés les moins fiables, les Poings bourrus et les Gauradans."; ["SUMMARY"] = "Defeat 100 Angmarim in Forochel"; ["TITLE"] = "Ennemi / Ennemie d'Angmar"; };
[1879109792] = {["ID"] = 1879109792; ["i"] = 6; ["j"] = 11; ["k"] = 9; ["TYPE"] = 4; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879103954; ["TIER"] = 2; ["MIN_LVL"] = 30; ["NAME"] = "Tueur d'Angmarim / Tueuse d'Angmarim (avancé)"; ["LORE"] = "Il possible que les Angmarim cherchent quelque chose, ou peut-être veulent-ils simplement prendre part aux rivalités entre Lossoth et Gauradans. Ils ne semblent pas vouloir envahir le Forochel. Du moins... pour le moment."; ["SUMMARY"] = "Defeat 200 Angmarim in Forochel"; };
[1879109793] = {["ID"] = 1879109793; ["i"] = 6; ["j"] = 11; ["k"] = 12; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879103954; ["TIER"] = 3; ["MIN_LVL"] = 30; ["NAME"] = "Tueur / Tueuse de Poings bourrus"; ["LORE"] = "De vieilles ruines de bâtiments construits par les nains parsèment le paysage du Forochel. Tenus pour être le peuple le plus robuste de tous les Peuples Libres, les nains soutiennent qu'ils furent les premiers à s'établir ici dans l'espoir de trouver des richesses sous la terre gelée. Mais ils abandonnèrent la plupart de leurs colonies il y a déjà bien longtemps. Désireux de se réaffirmer comme les héritiers légitimes de cette terre, les Poings bourrus cherchent à reconstruire les colonies des anciens seigneurs nains avec l'aide de leurs alliés angmarim. Naturellement, ceci a poussé leurs cousins les Longues Barbes à venir dans le Nord pour contester leur revendication, quelle que soit la valeur (ou la non-valeur) des mines qui se trouvent là."; ["SUMMARY"] = "Defeat 100 Dourhand Dwarves in Forochel"; ["TITLE"] = "Gardien / Gardienne des Mines"; };
[1879109794] = {["ID"] = 1879109794; ["i"] = 6; ["j"] = 11; ["k"] = 11; ["TYPE"] = 4; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879103954; ["TIER"] = 2; ["MIN_LVL"] = 30; ["NAME"] = "Tueur / Tueuse de Poings bourrus (avancé)"; ["LORE"] = "Les tentatives des Poings bourrus d'affirmer leur descendance des seigneurs nains d'autrefois semblent tout à fait inutiles à ce jour, leur sinistre alliance avec l'Angmar ne faisant plus l'ombre d'un doute pour les autres nains de la Terre du Milieu. Et pourtant, la tournure des événements les a rendus encore plus désespérés et dangereux, puisqu'ils se battent à présent pour la simple survie de leur triste lignée."; ["SUMMARY"] = "Defeat 200 Dourhand Dwarves in Forochel"; };
[1879109795] = {["ID"] = 1879109795; ["i"] = 6; ["j"] = 11; ["k"] = 14; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879103954; ["TIER"] = 3; ["MIN_LVL"] = 30; ["NAME"] = "Tueur / Tueuse de Gauradans"; ["LORE"] = "Vous entrez enfin sur les terres des Gauradans, et à voir cet endroit, vous comprenez à quel point la rigueur et la violence de leur environnement ont pu faire d'eux des brutes aussi redoutables. Et pourtant, sous le même climat impitoyable, les Lossoth ont, eux, réussi à maintenir certains signes extérieurs de civilisation. Les Gauradans ont-ils choisi leur chemin ou continuent-ils de payer leur antique connivence avec l'Ennemi ?"; ["SUMMARY"] = "Defeat 100 Gauradan in Forochel"; ["TITLE"] = "Rempart contre les Sauvages"; };
[1879109796] = {["ID"] = 1879109796; ["i"] = 6; ["j"] = 11; ["k"] = 13; ["TYPE"] = 4; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879103954; ["TIER"] = 2; ["MIN_LVL"] = 30; ["NAME"] = "Tueur / Tueuse de Gauradans (avancé)"; ["LORE"] = "Il semble tout à fait étrange que deux peuples comme les Gauradans et les Lossoth se disputent si vivement une terre aussi cruelle et inhospitalière que le Forochel, et pourtant leur conflit est interminable. On se sent sûrement chez soi là où l'on a vécu, quel que soit l'endroit ; et que l'on soit un Homme, un nain, un hobbit, un Elfe, un orque ou toute autre créature, on souhaite défendre ce que l'on connaît."; ["SUMMARY"] = "Defeat 200 Gauradan in Forochel"; };
[1879109797] = {["ID"] = 1879109797; ["i"] = 6; ["j"] = 11; ["k"] = 16; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879103954; ["TIER"] = 3; ["MIN_LVL"] = 30; ["NAME"] = "Tueur / Tueuse de Macabras"; ["LORE"] = "Les Gauradans pensent que les macabras sont les âmes errantes de ceux qui furent rejetés par leur peuple pour leur lâcheté, puis condamnés à vagabonder éternellement sur les étendues neigeuses après être morts de froid. Les rares sages qui connaissent ces créatures considèrent toutefois que ce sont plus vraisemblablement des esprits cruels qui errent sur les terres désolées du nord depuis la chute du Seigneur Ténébreux, qu'ils servaient il y a bien longtemps."; ["SUMMARY"] = "Defeat 40 Grims in Forochel"; ["TITLE"] = "Fend-la-Glace"; };
[1879109798] = {["ID"] = 1879109798; ["i"] = 6; ["j"] = 11; ["k"] = 15; ["TYPE"] = 4; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879103954; ["TIER"] = 2; ["MIN_LVL"] = 30; ["NAME"] = "Tueur / Tueuse de Macabras (avancé)"; ["LORE"] = "S'il y a la moindre trace d'un esprit autrefois vivant chez les macabras, elle ne semble pas suffire à leur faire manifester une quelconque pitié ou compassion. Au plus petit signe de chaleur ou de vie, ils attaquent en braillant dans l'intention d'y mettre fin avec toute leur haine."; ["SUMMARY"] = "Defeat 80 Grims in Forochel"; };
[1879109799] = {["ID"] = 1879109799; ["i"] = 6; ["j"] = 11; ["k"] = 18; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879103954; ["TIER"] = 3; ["MIN_LVL"] = 30; ["NAME"] = "Tueur / Tueuse de kilpa-kita"; ["LORE"] = "Ces félins sauvages sont des prédateurs particulièrement violents et dénués de discernement. Au cours de leurs chasses, les Lossoth respectent scrupuleusement leur territoire, de peur de servir de repas à ces meurtrières créatures. En outre, les quelques têtes de bétail qu'ils possèdent vivent sous la menace constante de ces bêtes voraces."; ["SUMMARY"] = "Defeat 100 Sabre-tooths in Forochel"; ["TITLE"] = "Brise-Crocs"; };
[1879109800] = {["ID"] = 1879109800; ["i"] = 6; ["j"] = 11; ["k"] = 17; ["TYPE"] = 4; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879103954; ["TIER"] = 2; ["MIN_LVL"] = 30; ["NAME"] = "Tueur / Tueuse de kilpa-kita (avancé)"; ["LORE"] = "Les kilpa-kita sont un danger constant dans les forêts du Forochel. Seuls les plus courageux des chasseurs lossoth osent chasser à proximité de leur repaire, et ils n'en reviennent pas toujours vivants."; ["SUMMARY"] = "Defeat 200 Sabre-tooths in Forochel"; };
[1879109801] = {["ID"] = 1879109801; ["i"] = 6; ["j"] = 11; ["k"] = 20; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879103954; ["TIER"] = 3; ["MIN_LVL"] = 30; ["NAME"] = "Tueur de vers / Tueuse de vers"; ["LORE"] = "Les vers du Forochel se sont adaptés à la froideur de leur environnement. Ils ont un manteau d'écailles garni d'une étrange fourrure pour se protéger du froid, tandis que leurs griffes et leurs dents distillent une étrange substance glaciale qui fait souvent succomber leurs victimes à un froid mortel."; ["SUMMARY"] = "Defeat 100 Worms in Forochel"; ["TITLE"] = "Fléau de l'Hiver"; };
[1879109802] = {["ID"] = 1879109802; ["i"] = 6; ["j"] = 11; ["k"] = 19; ["TYPE"] = 4; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879103954; ["TIER"] = 2; ["MIN_LVL"] = 30; ["NAME"] = "Tueur de vers / Tueuse de vers (avancé)"; ["LORE"] = "On ne sait pas si ces vers sont originaires du Forochel ou s'ils sont venus des terres désolées du nord pendant l'hiver, lorsque la baie est assez gelée pour les laisser passer. Bien sûr, tout cela n'a plus d'importance, car ils sont bel et bien là à présent et ils menacent tous les habitants du Forochel."; ["SUMMARY"] = "Defeat 200 Worms in Forochel"; };
[1879110246] = {["ID"] = 1879110246; ["i"] = 6; ["j"] = 11; ["k"] = 21; ["TYPE"] = 7; ["LP"] = 5; ["REP"] = 700; ["FACTION"] = 1879103954; ["TIER"] = 1; ["MIN_LVL"] = 43; ["NAME"] = "La Communauté Perdue"; ["LORE"] = "La Communauté Perdue était un groupe courageux qui partit d'Angmar pour trouver un trésor dans le Forochel. Hélas, elle rencontra des ennuis sur son chemin...."; ["SUMMARY"] = "Aid the members of the lost fellowship"; ["TITLE"] = "Héros / Héroïne de la Communauté Perdue"; };
