[1879141040] = {["ID"] = 1879141040; ["i"] = 7; ["j"] = 2; ["k"] = 30; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879143761; ["TIER"] = 3; ["MIN_LVL"] = 47; ["NAME"] = "Tueur / Tueuse de griffefosses"; ["LORE"] = "Les mines de la Moria sont infestées de griffefosses et de grifferoches, en telle supériorité numérique qu’elles entravent gravement les efforts des nains pour restituer à leur royaume sa gloire d’antan. Quiconque limiterait la prolifération de cette vermine leur rendrait un fier service."; ["SUMMARY"] = "Defeat 100 Deep-claws in Moria"; ["TITLE"] = "casseur / casseuse de bec"; };
[1879141041] = {["ID"] = 1879141041; ["i"] = 7; ["j"] = 2; ["k"] = 29; ["TYPE"] = 4; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879143766; ["TIER"] = 2; ["MIN_LVL"] = 47; ["NAME"] = "Tueur / Tueuse de griffefosses (avancé)"; ["LORE"] = "Continuer d’enrayer la prolifération des ignobles griffefosses apporterait une aide précieuse aux nains qui tentent de reprendre Khazad-dûm. Outre qu’elles souillent les galeries des mines, ces créatures attaquent tout explorateur assez courageux pour s’y aventurer."; ["SUMMARY"] = "Defeat 200 Deep-claws in Moria"; };
[1879141042] = {["ID"] = 1879141042; ["i"] = 7; ["j"] = 2; ["k"] = 32; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879143761; ["TIER"] = 3; ["MIN_LVL"] = 47; ["NAME"] = "Tueur / Tueuse de dragonnets"; ["LORE"] = "Dans les endroits obscurs de la Moria vivent de minuscules dragonnets, une forme de dragon dont la croissance a été sévèrement retardée, leur taille dépassant à peine celle d'une chauve-souris commune. Ces créatures malfaisantes sont une terrible source de tracas pour les nains qui se démènent pour reprendre leur contrée d'origine."; ["SUMMARY"] = "Defeat 100 Dragonets in Moria"; ["TITLE"] = "anéantisseur / anéantisseuse de drakes"; };
[1879141043] = {["ID"] = 1879141043; ["i"] = 7; ["j"] = 2; ["k"] = 31; ["TYPE"] = 4; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879143766; ["TIER"] = 2; ["MIN_LVL"] = 47; ["NAME"] = "Tueur / Tueuse de dragonnets (avancé)"; ["LORE"] = "Vos efforts ont déjà largement contribué à purger la Moria des ignobles dragonnets. En exterminer davantage serait un soulagement au-delà des mots. Cependant, on ne saurait tolérer que les dragons souillent les grandes salles des nains."; ["SUMMARY"] = "Defeat 200 Dragonets in Moria"; };
[1879141044] = {["ID"] = 1879141044; ["i"] = 7; ["j"] = 2; ["k"] = 34; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879143761; ["TIER"] = 3; ["MIN_LVL"] = 47; ["NAME"] = "Tueur / Tueuse de Globsnaga"; ["LORE"] = "Les Orques infestent les voies longues et sinueuses de Khazad-dûm. Mais il y a peu, un danger encore pire a surgi : les Globsnaga, des Orques infectés par un abominable fongus."; ["SUMMARY"] = "Defeat 100 Globsnaga in Moria"; ["TITLE"] = "fléau des contaminés"; };
[1879141045] = {["ID"] = 1879141045; ["i"] = 7; ["j"] = 2; ["k"] = 33; ["TYPE"] = 4; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879143766; ["TIER"] = 2; ["MIN_LVL"] = 47; ["NAME"] = "Tueur / Tueuse de Globsnaga (avancé)"; ["LORE"] = "Vous avez vaincu un grand nombre de Globsnaga, les Orques de la Moria infectés par le fongus. Rien ne vous fait reculer, pas même la maladie qui les terrasse. Il faut les détruire jusqu’au dernier, car le fléau qu’ils portent en eux est une dangereuse invention de l’Ennemi."; ["SUMMARY"] = "Defeat 200 Globsnaga in Moria"; };
[1879141046] = {["ID"] = 1879141046; ["i"] = 7; ["j"] = 2; ["k"] = 36; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879143761; ["TIER"] = 3; ["MIN_LVL"] = 47; ["NAME"] = "Tueur de gobelins / Tueuse de gobelins"; ["LORE"] = "Les gobelins se sont abattus comme une nuée de fourmis sur Khazad-dûm, où ils ont élu domicile. Ils ont creusé la montagne toujours plus profondément, en quête des trésors des nains. Enrayer leur prolifération serait d’un héroïsme qui, au-delà de la Moria, serait connu dans toute la Terre du Milieu, car les gobelins représentent une grave nuisance partout où ils s’installent."; ["SUMMARY"] = "Defeat 100 Goblins in Moria"; ["TITLE"] = "fléau des gobelins"; };
[1879141047] = {["ID"] = 1879141047; ["i"] = 7; ["j"] = 2; ["k"] = 35; ["TYPE"] = 4; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879143766; ["TIER"] = 2; ["MIN_LVL"] = 47; ["NAME"] = "Tueur de gobelins / Tueuse de gobelins (avancé)"; ["LORE"] = "Votre combat inlassable contre les gobelins a été d’un grand secours pour les nains de la Moria. Pourtant, on dit que lorsque l’un d’eux tombe, deux autres prennent sa place. Il faut les détruire systématiquement, car ils sont nuisibles jusqu’à la moelle, et sèment le mal partout où ils passent."; ["SUMMARY"] = "Defeat 200 Goblins in Moria"; };
[1879141048] = {["ID"] = 1879141048; ["i"] = 7; ["j"] = 2; ["k"] = 38; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879143761; ["TIER"] = 3; ["MIN_LVL"] = 47; ["NAME"] = "Tueur / Tueuse de grodbogs"; ["LORE"] = "Les grodbogs, qui sont d’imposants insectes, ont été attirés par la gigantesque obscurité de la Moria comme des mouches par la lumière. Tapis dans l’ombre, ils sont prêts à piéger à tout moment le voyageur imprudent, sur des chemins qui sont ici toujours sinueux."; ["SUMMARY"] = "Defeat 100 Gredbyg in Moria"; ["TITLE"] = "exterminateur / exterminatrice de vermine"; };
[1879141049] = {["ID"] = 1879141049; ["i"] = 7; ["j"] = 2; ["k"] = 37; ["TYPE"] = 4; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879143766; ["TIER"] = 2; ["MIN_LVL"] = 47; ["NAME"] = "Tueur / Tueuse de grodbogs (avancé)"; ["LORE"] = "Une bonne partie des ignobles insectes de la Moria a été éliminée. Toutefois, il ne faut pas relâcher cet effort. Les grodbogs ne quittent jamais les lieux où ils vivent, mais il faut en limiter le nombre, sans quoi ils envahiront de nouveau les grottes. Maîtriser les grodbogs de la Moria est une tâche à poursuivre sans relâche."; ["SUMMARY"] = "Defeat 200 Gredbyg in Moria"; };
[1879141050] = {["ID"] = 1879141050; ["i"] = 7; ["j"] = 2; ["k"] = 40; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879143761; ["TIER"] = 3; ["MIN_LVL"] = 47; ["NAME"] = "Tueur / Tueuse de morrovals"; ["LORE"] = "Les morrovals d'Angmar sont d’indignes créatures, irrémédiablement corrompues. Ne se complaisant que dans des milieux obscurs et sordides, elles détruisent tout ce qui est lumière. Même les oppressantes ténèbres de la Moria ne suffisent pas à étancher leur soif de noirceur sans espoir."; ["SUMMARY"] = "Defeat 100 Merrevail in Moria"; ["TITLE"] = "briseur / briseuse d’ailes"; };
[1879141051] = {["ID"] = 1879141051; ["i"] = 7; ["j"] = 2; ["k"] = 39; ["TYPE"] = 4; ["VXP"] = 4000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879143766; ["TIER"] = 2; ["MIN_LVL"] = 47; ["NAME"] = "Tueur / Tueuse de morrovals (avancé)"; ["LORE"] = "Ces misérables êtres aux allures de chauves-souris ont fort à faire avec des adversaires de votre trempe, car vous avez déjà pourfendu nombre de morrovals. Vous avez ainsi redonné de la lumière aux galeries."; ["SUMMARY"] = "Defeat 200 Merrevail in Moria"; };
[1879141052] = {["ID"] = 1879141052; ["i"] = 7; ["j"] = 2; ["k"] = 42; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879143761; ["TIER"] = 3; ["MIN_LVL"] = 47; ["NAME"] = "Tueur / Tueuse de Sans-Nom"; ["LORE"] = "Les Sans-Nom sont probablement des créatures corrompues d'une époque révolue, bien qu’on ignore la cause de leur altération ou ce qu'elles pouvaient être autrefois. Assoiffés de sang, ces impitoyables ennemis attaquent aveuglément quiconque s’aventure à leur portée."; ["SUMMARY"] = "Defeat 100 Nameless in Moria"; ["TITLE"] = "vainqueur des Sans-Nom"; };
[1879141053] = {["ID"] = 1879141053; ["i"] = 7; ["j"] = 2; ["k"] = 41; ["TYPE"] = 4; ["VXP"] = 4000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879143766; ["TIER"] = 2; ["MIN_LVL"] = 47; ["NAME"] = "Tueur / Tueuse de Sans-Nom (avancé)"; ["LORE"] = "Bien que vous ayez éliminé de nombreux Sans-Nom, le danger qu’ils représentent en a été à peine amoindri. Quiconque lutte contre ces terribles créatures mérite la force tirée de cet exploit."; ["SUMMARY"] = "Defeat 200 Nameless in Moria"; };
[1879141054] = {["ID"] = 1879141054; ["i"] = 7; ["j"] = 2; ["k"] = 46; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879143761; ["TIER"] = 3; ["MIN_LVL"] = 47; ["NAME"] = "Tueur / Tueuse d'araignées"; ["LORE"] = "Les araignées comptent au nombre des créatures les plus cruelles et néfastes de la Terre du Milieu. Elles ont créé dans les ténèbres de Khazad-dûm d’innombrables nids, masquant le peu de lumière qui subsistait dans ces lieux désolés."; ["SUMMARY"] = "Defeat 100 Spiders in Moria"; ["TITLE"] = "l’Opiniâtre"; };
[1879141055] = {["ID"] = 1879141055; ["i"] = 7; ["j"] = 2; ["k"] = 45; ["TYPE"] = 4; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879143766; ["TIER"] = 2; ["MIN_LVL"] = 47; ["NAME"] = "Tueur d'araignées / Tueuse d'araignées (avancé)"; ["LORE"] = "Combattre sans pitié les araignées de la Terre du Milieu relève de l’exploit. Il faut pourtant persister sans relâche à éradiquer cette horrible nuisance."; ["SUMMARY"] = "Defeat 200 Spiders in Moria"; };
[1879141056] = {["ID"] = 1879141056; ["i"] = 7; ["j"] = 2; ["k"] = 53; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879143761; ["TIER"] = 1; ["MIN_LVL"] = 47; ["NAME"] = "Tueur de trolls / Tueuse de trolls"; ["LORE"] = "Les trolls écument les salles occupées jadis par les nains, les faisant résonner de leurs pas tonitruants et de leurs féroces crises de rage. Par leur brutalité et leur manque de respect, ils y détruisent des siècles de création artistique."; ["SUMMARY"] = "Defeat 50 Trolls in Moria"; ["TITLE"] = "briseur / briseuse de trolls"; };
[1879141057] = {["ID"] = 1879141057; ["i"] = 7; ["j"] = 2; ["k"] = 52; ["TYPE"] = 4; ["VXP"] = 2000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879143766; ["MIN_LVL"] = 47; ["NAME"] = "Tueur de trolls / Tueuse de trolls (avancé)"; ["LORE"] = "Il faut une âme bien trempée pour vaincre un troll doté d’une corpulence et d’une force largement supérieure à celle de l’Homme le plus robuste. Vous en avez d’ores et déjà éliminé assez pour gagner les honneurs correspondant à vos mérites. Mais en venant à bout d’un plus grand nombre d’entre eux, vous bénéficieriez d’une force au combat encore plus grande."; ["SUMMARY"] = "Defeat 100 Trolls in Moria"; };
[1879141058] = {["ID"] = 1879141058; ["i"] = 7; ["j"] = 2; ["k"] = 48; ["TYPE"] = 4; ["LP"] = 5; ["REP"] = 500; ["FACTION"] = 1879143761; ["TIER"] = 3; ["MIN_LVL"] = 47; ["NAME"] = "Tueur / Tueuse d'ouargues"; ["LORE"] = "Si le silence de la Moria est parfois terrifiant, les hurlements qui le brisent de temps à autre le sont encore plus. Les ouargues chassent dans l’obscurité, en participant aux sombres desseins des Orques et des gobelins, avec lesquels ils cohabitent."; ["SUMMARY"] = "Defeat 100 Wargs in Moria"; ["TITLE"] = "le / la Féroce"; };
[1879141059] = {["ID"] = 1879141059; ["i"] = 7; ["j"] = 2; ["k"] = 47; ["TYPE"] = 4; ["VXP"] = 4000; ["LP"] = 10; ["REP"] = 700; ["FACTION"] = 1879143761; ["TIER"] = 2; ["MIN_LVL"] = 47; ["NAME"] = "Tueur / Tueuse d'ouargues (avancé)"; ["LORE"] = "Vous avez largement contribué à faire taire les ignobles braillements des ouargues dans les mines de la Moria. Mais leur présence restera prépondérante si rien de plus n’est entrepris contre eux. En continuant à chasser ces bêtes aussi féroces que serviles, vous aideriez grandement les nains à reprendre possession de Khazad-dûm."; ["SUMMARY"] = "Defeat 200 Wargs in Moria"; };
[1879144730] = {["ID"] = 1879144730; ["i"] = 5; ["j"] = 1; ["k"] = 406; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 193; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Foudre et flammes"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Foudre et flammes fut écrit par un gardien des runes de l’ancien royaume de Khazad-dûm, qui aurait occupé le poste de conseiller du roi Durin en personne. A ce qu’il paraît, ce vieux livre renfermait un grand nombre de secrets de l’Angerthas, transmis depuis le tout début du Premier Age. Il décrit en détail les finesses du cirth et indique comment déchaîner contre un ennemi la tempête, le froid, le feu et les autres éléments. Mais au bout du compte, ces vastes pouvoirs ne suffirent ni à vaincre la cupidité des nains, ni à empêcher la destruction de la Moria, lorsque s’éveilla la créature maléfique qui sommeillait dans ses entrailles."; ["SUMMARY"] = "Buy Thunder and Flame from a Rune-keeper Trainer and find the missing pages (8)"; };
[1879144731] = {["ID"] = 1879144731; ["i"] = 5; ["j"] = 1; ["k"] = 408; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 193; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Golu o Maeth"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Le Golu o Maeth est l'œuvre, dit-on, d'un grand lettré de l'ancien royaume de Doriath. C'est l'une des plus anciennes codifications des principes de l'écriture runique, il s'agit d'une étude détaillée du Tengwar et de ses liens avec le combat. Après la destruction du Beleriand, on croyait cette science disparue. Pourtant, selon des rumeurs persistantes, un exemplaire au moins aurait été emporté à l'est de l'Ered Luin avant la catastrophe. Le temps n'a pas épargné ce volume, dont de nombreuses pages tombent en poussière, mais sa valeur serait sans doute incomparable aux yeux d'Elrond de Fondcombe."; ["SUMMARY"] = "Buy Golu o Maeth from a Rune-keeper Trainer and find the missing pages (8)"; };
[1879144732] = {["ID"] = 1879144732; ["i"] = 5; ["j"] = 1; ["k"] = 407; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 193; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Murmures dans les Ténèbres"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. 'Murmures dans les Ténèbres', l’un des livres les plus étranges qui soient, fut écrit non pas par un Elfe ou un Nain, mais par un Homme. Il provient de Rhudaur, peu avant sa chute, pendant la guerre entre l’Arnor et les forces du Roi-Sorcier. Ses pages évoquent un genre de pouvoirs qu’aucun Homme n’a jamais été apte à acquérir, et encore moins à dominer. L’écriture est celle d’un dément : des runes griffonnées de façon irrégulière, voire désordonnée sur des pages maculées dont beaucoup, volantes, ont simplement été glissées dans l’ouvrage. A force de chercher à percer les secrets de l’écriture runique, l’auteur serait devenu fou. Il paraît toutefois que son œuvre recèle des vérités aussi terribles que profondes. La reliure du livre étant en bien mauvais état, seule la première moitié des pages, jaunies et desséchées, tient encore à sa couverture grossière. Il n’en reste pas moins qu'Elrond donnerait cher pour en connaître le contenu"; ["SUMMARY"] = "Buy Whispers in the Dark from a Rune-keeper Trainer and find the missing pages (8)"; };
[1879144733] = {["ID"] = 1879144733; ["i"] = 5; ["j"] = 1; ["k"] = 411; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 194; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Sentinelles contre les ténèbres"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Gondolin était la ville des légendaires sentinelles des Temps Anciens. Ce volume contient une chronique, tenue par le scribe d'une de ces troupes de combattants elfes au cours de l'interminable guerre contre Morgoth. Ecrite en linnods, cette épopée relate principalement les multiples incursions des forces de la célèbre cité contre les royaumes ennemis. Comme tous les récits de l’époque, elle se transforme vite en tragédie car les sentinelles furent vaincues l’une après l’autre, la plupart périssant sur le champ de bataille alors que d'autres finirent dans les lugubres cachots de Morgoth, où leur volonté fut brisée. Un grand nombre des tactiques transmises aux sentinelles proviennent de ce livre, qui s’interrompt brusquement sur la chute, tragique elle aussi, de la grande cité de Gondolin."; ["SUMMARY"] = "Buy The Watch Against the Night from a Warden Trainer and find the missing pages (8)"; };
[1879144734] = {["ID"] = 1879144734; ["i"] = 5; ["j"] = 1; ["k"] = 412; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 194; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Les Chefs des Dunedain"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Les Chefs des Dunedain est une chronique, tenue par les Rôdeurs du Nord, qui y faisaient état de la sagesse de chacun de leurs seigneurs, depuis le premier, Aranarth, jusqu'à Arador. C'est une mine de savoir sur les débuts des Rôdeurs du temps où, après la chute d'Arnor, ils furent dispersés comme jamais ils ne devaient l'être par la suite. Ces annales disparurent lorsque les trolls tuèrent Arador dans les Landes d'Etten. On suppose qu'il enterra le livre avant la bataille qui devait s'achever par sa mort, mais nul ne sait où. Une nouvelle chronique commença avec son fils, Arathorn II, mais toute la sagesse des précédents seigneurs fut perdue, sans doute à jamais."; ["SUMMARY"] = "Buy Chieftains of the Dúnedain from a Warden Trainer and find the missing pages (8)"; };
[1879144735] = {["ID"] = 1879144735; ["i"] = 5; ["j"] = 1; ["k"] = 413; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 194; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Le Fils du Taureau mugissant"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis vaincus en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis vaincus dans le Forochel, la Moria et les Monts Brumeux. Ecrit il y a environ deux siècles, 'Le Fils du Taureau Mugissant' est un journal fantasque, tenu par Haldemar Touque, l’un des plus jeunes fils de Bandobras Touque. Après la bataille des Champs Verts, Haldemar devint une sentinelle de la Comté. Il se mit alors à raconter des histoires d'aventures au-delà des frontières de la Comté, relatant pour la plupart avec humour des batailles contre des gobelins, trolls et autres créatures dont certaines totalement imaginaires. Bien que l’essentiel de l’ouvrage soit totalement fantaisiste, il contient un fond de vérité que toute sentinelle devrait apprécier. Malheureusement, les trois exemplaires connus du livre ont tous été volés voilà près de cent ans et ce, curieusement, en l’espace d’une semaine."; ["SUMMARY"] = "Buy Bullroarer's Boy from a Warden Trainer and find the missing pages (8)"; };
