[1879316232] = {["ID"] = 1879316232; ["i"] = 5; ["j"] = 1; ["k"] = 360; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 214; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Vacances d'un hobbit"; ["LORE"] = "Les quatre premières pages de ce livre se trouvent sur des ennemis éparpillés en Angmar, dans l'Eregion et dans la Moria. Les quatre dernières peuvent être récupérées sur des ennemis dispersés dans le Forochel, la Moria et les Monts Brumeux. Vacances d'hun hobbit a été écrit par Bilbon Sacquet, un hobbit de la Comté qui a vécu une aventure aussi incroyable qu'inattendue. Vous feuilletez les pages avec intérêt, cherchant le récit de sa rencontre avec Beorn, votre ancêtre, mais vous ne le trouvez pas. Un grand nombre de pages ont disparu au milieu du livre, et un chapitre entier semble manquer. Se pourrait-il que ce soit dans celui-là qu'il parle de Beorn ?"; ["SUMMARY"] = "Buy A Hobbit's Holiday from a Beorning Trainer and find the missing pages (8)"; };
[1879316233] = {["ID"] = 1879316233; ["i"] = 5; ["j"] = 1; ["k"] = 362; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 214; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Généalogie des Beornides"; ["LORE"] = "Les quatre premières pages de ce livre se trouvent sur des ennemis éparpillés en Angmar, dans l'Eregion et dans la Moria. Les quatre dernières peuvent être récupérées sur des ennemis dispersés dans le Forochel, la Moria et les Monts Brumeux. Ce livre contient plusieurs arbres généalogiques censés représenter les diverses branches de votre famille, mais plusieurs pages manquent. Vous ignorez qui en est l'auteur, mais peut-être que Bilbon Sacquet, qui réside actuellement à Fondcombe, pourrait vous en parler. Il s'intéresse à ce genre de sujet et a personnellement connu votre parent Beorn."; ["SUMMARY"] = "Buy Genealogy of the Beornings from a Beorning Trainer and find the missing pages (8)"; };
[1879316234] = {["ID"] = 1879316234; ["i"] = 5; ["j"] = 1; ["k"] = 361; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 214; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Une étude d'un changeur de peau"; ["LORE"] = "Les quatre premières pages de ce livre se trouvent sur des ennemis éparpillés en Angmar, dans l'Eregion et dans la Moria. Les quatre dernières peuvent être récupérées sur des ennemis dispersés dans le Forochel, la Moria et les Monts Brumeux. Cet étrange manuel a l'air de détailler la nature du pouvoir que possèdent les membres de votre famille de prendre la forme des animaux. Il semble étudier un changeur de peau sur plusieurs années, et a manifestement été écrit il y a très longtemps par quelqu'un qui ne comprenait pas ce pouvoir. Vous ne pouvez que vous demander s'il y a ne serait-ce qu'une part de vérité dans ce récit pour le moins fantaisiste. Plusieurs pages manquent, mais un petit parchemin, bien plus récent, a été plié dans la couverture. Seuls deux mots sont inscrits dessus : 'Demander à Bilbon'"; ["SUMMARY"] = "Buy A Study of the Skin-changer from a Beorning Trainer and find the missing pages (8)"; };
