[1879457857] = {["ID"] = 1879457857; ["i"] = 2; ["j"] = 15; ["k"] = 9; ["TYPE"] = 4; ["VXP"] = 2000; ["TIER"] = 2; ["MIN_LVL"] = 140; ["NAME"] = "Sant Lhoer, les Jardins empoisonnés -- niveau 3"; ["LORE"] = "Sant Lhoer, connu sous le nom des Jardins empoisonnés de Carn Dûm, est un lieu humide qui regorge de plantes, d'arbres et de fleurs mortels, jamais vus ou presque en Terre du Milieu. Au-delà des eaux vertes fétides qui traversent Sant Lhoer s'élèvent d'immenses structures en verre, dont Bâr Heledh, la Maison de verre. C'est ici que la sorcière Oganuin exerce son art : des expériences sur toutes sortes d'êtres vivants. À quelle fin, et dans quel but ? De très sombres desseins, sans aucun doute."; ["TITLE"] = "Semeur / Semeuse de désolation de Sant Lhoer"; };
