[1879457975] = {["ID"] = 1879457975; ["i"] = 5; ["j"] = 1; ["k"] = 396; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 216; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "L'Art du duel"; ["LORE"] = "Vous trouverez les premières pages de ce livre sur les cadavres d'ennemis répandus dans l'Angmar, l'Eregion et la Moria. Vous trouverez les quatre dernières pages de ce livre sur les cadavres d'ennemis répandus dans le Forochel, la Moria et les Monts Brumeux. L'Art du duel a été écrit par un érudit de Dol Amroth et commence par un prologue dans lequel l'auteur, Pethebir, révèle au lecteur que dans sa jeunesse, il a servi le père du Prince Imrahil en tant que loyal chevalier au cygne. Le livre fait état des nombreuses compétences et techniques employées non seulement par les guerriers de Dol Amroth et des autres fiefs du Gondor, mais aussi par les Corsaires d'Umbar, avec qui ils étaient souvent en conflit. De plus, le livre raconte l'histoire d'un certain Thorongil, grand capitaine et guerrier talentueux, duelliste de renom et conseiller avisé d'Ecthelion II, ancien Intendant du Gondor."; };
