[1879458029] = {["ID"] = 1879458029; ["i"] = 5; ["j"] = 1; ["k"] = 397; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 216; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Compendium de chants marins"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis dispersés en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis dispersés dans le Forochel, la Moria et les Monts Brumeux. Le Compendium de chants marins semble avoir été rédigé au fil de nombreuses années, voire de nombreux siècles, par plusieurs auteurs partageant des opinions bien divergentes. Cet exemplaire précis comporte une multitude de notes, ses marges étant parsemées de réflexions griffonnées par le précédent lecteur. Plusieurs passages ont été entièrement barrés et vous remarquez que certains chants marins ont été modifiés, les mentions d'Umbar remplacées par Bree. Le livre fournit tout de même une histoire détaillée des chants marins et comprend un recueil d'œuvres chantées par les Marins du Gondor et d'Umbar."; };
