[1879458042] = {["ID"] = 1879458042; ["i"] = 5; ["j"] = 1; ["k"] = 398; ["TYPE"] = 8; ["CRV"] = "Class"; ["SUBTYPE"] = 216; ["LP"] = 10; ["MIN_LVL"] = 39; ["NAME"] = "Guide des étoiles"; ["LORE"] = "Vous trouverez les quatre premières pages de ce livre sur des ennemis dispersés en Angmar, en Eregion et dans la Moria. Vous trouverez les quatre dernières sur des ennemis dispersés dans le Forochel, la Moria et les Monts Brumeux. Le Guide des étoiles aurait été écrit par Cirdan le Charpentier naval, maître des Havres Gris, mais cette allégation est souvent contestée. De nombreux lecteurs soulignent que cet ouvrage n'a pas été rédigé à la manière des Elfes, même si, curieusement, les Elfes eux-mêmes n'ont jamais formulé cette critique. Néanmoins, ses esquisses et diagrammes visant à cartographier les étoiles de la Terre du Milieu ont reçu nombre d'éloges. Quel que soit son véritable auteur, ce livre renferme une montagne de savoir quant à la position des étoiles et constellations, ainsi qu'à la façon dont celles-ci permettent de guider les marins en Mer."; };
