[1879458701] = {["ID"] = 1879458701; ["i"] = 2; ["j"] = 15; ["k"] = 48; ["TYPE"] = 4; ["NA"] = 3; ["MIN_LVL"] = 140; ["NAME"] = "Thaurisgar, l'infâme échoppe d'apothicaire -- niveau 3 -- En avant"; ["LORE"] = "Dans les profondeurs de Thaurisgar, d'innombrables créatures nées d'expériences abominables et perverties errent dans l'obscurité, terrible héritage d'Aniochan le Tourmenteur. Avant la chute de Carn Dûm, Aniochan travaillait sans relâche pour surpasser ses rivaux et gagner les faveurs de l'Intendant d'Angmar. Parmi les outils qu'il utilisait pour façonner ses créations figurait un curieux ichor connu sous le nom de bile d'Ifrinn. Considérée comme perdue après qu'une expérience désastreuse eut coûté la vie à Aniochan, cette infâme substance fétide risque maintenant de se répandre dans toute la Terre du Milieu."; ["TITLE"] = "Meneur / Meneuse à Thaurisgar"; };
