[1879468651] = {["ID"] = 1879468651; ["i"] = 5; ["j"] = 2; ["k"] = 55; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 125; ["LP"] = 5; ["MIN_LVL"] = 13; ["NAME"] = "Ennemi / Ennemie des loups"; ["LORE"] = "Les loups sont depuis longtemps un fléau pour les paisibles Hobbits des rivières de Havrebrume. Lors des hivers rigoureux, ils rôdent souvent autour des Puits du Long Fleuve et dans le Val d'Anduin au sud, attaquant violemment le bétail et les Hobbits des rivières eux-mêmes. Aujourd'hui, cependant, il y a lieu de s'interroger, car ils se sont éloignés du Nord en meutes de plus en plus nombreuses, et ils ont l'air plus qu'affamés : des rumeurs courent même selon lesquelles nombre de ces meutes ont été dressées par un nouveau mal pour les rendre encore plus violentes, pour s'attaquer aux imprudents et aux faibles, et pour flairer ceux qui voudraient se cacher de l'Ennemi."; };
[1879468653] = {["ID"] = 1879468653; ["i"] = 5; ["j"] = 2; ["k"] = 54; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 125; ["LP"] = 10; ["MIN_LVL"] = 19; ["NAME"] = "Ennemi / Ennemie des loups II"; ["LORE"] = "Les légendes parlent de gobelins, de chauves-souris et de ouargues fidèles à un ancien seigneur orque qui régnait sur le mont Gundabad. On dit que sa méchanceté était telle qu'il attirait toutes sortes de créatures immondes dans les terres environnantes, dont les loups féroces qui troublent depuis longtemps les Hobbits des rivières de Havrebrume ne sont pas les moindres représentants. Cela se serait-il reproduit ? Le Nord abrite-t-il de nouveaux dangers ? Quoi qu'il en soit, il semble de mauvais augure que l'on trouve désormais des loups dans presque toute la Terre du Milieu."; };
[1879468656] = {["ID"] = 1879468656; ["i"] = 5; ["j"] = 2; ["k"] = 57; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 125; ["LP"] = 5; ["MIN_LVL"] = 19; ["NAME"] = "Ennemi / Ennemie des trolls des bois"; ["LORE"] = "Il y a bien longtemps, les Hobbits des rivières de Havrebrume rencontrèrent pour la première fois les démons des bois de la Forêt Noire, et les récits de ces terribles créatures sont entrés dans la légende. Chez les Elfes, on les appelle les trolls des bois, et l'on raconte que de leurs membres noueux dégouline un poison mortel, si terrible qu'il pourrait faire pourrir une forêt entière."; };
[1879468657] = {["ID"] = 1879468657; ["i"] = 5; ["j"] = 2; ["k"] = 56; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 125; ["LP"] = 10; ["MIN_LVL"] = 25; ["NAME"] = "Ennemi / Ennemie des trolls des bois II"; ["LORE"] = "Il existe bien des légendes autour des démons des bois du Nord, qui gangrènent le vieux Vertbois. D'après les rumeurs, des êtres semblables sont apparus dans des contrées bien au-delà des frontières de la Forêt Noire et du Puits du Long Fleuve. Depuis, nombre de Hobbits des rivières de Havrebrume sont désormais persuadés que la nature est corrompue par une influence invisible."; };
[1879468717] = {["ID"] = 1879468717; ["i"] = 5; ["j"] = 2; ["k"] = 58; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 125; ["LP"] = 15; ["MIN_LVL"] = 30; ["NAME"] = "Ennemi / Ennemie des Orques et gobelins III"; ["LORE"] = "Les Orques détestent presque autant le soleil que les gobelins, mais ils le tolèrent mieux que ces derniers et peuvent le supporter pendant un certain temps en cas de nécessité ou si leurs maîtres les y forcent. Cela dit, les Hobbits des rivières de Havrebrume savent bien que les Orques et les gobelins du Nord rôdent souvent dans les brumes qui enveloppent les Puits du Long Fleuve."; };
[1879468718] = {["ID"] = 1879468718; ["i"] = 5; ["j"] = 2; ["k"] = 59; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 125; ["LP"] = 10; ["MIN_LVL"] = 25; ["NAME"] = "Ennemi / Ennemie des Orques et gobelins II"; ["LORE"] = "Les Orques et les gobelins ne sont ni lâches ni faibles, mais leur force et leur détermination souvent aveugles ne sont guère utiles contre un ennemi insaisissable ou dont ils ne sont même pas certains de l'existence ! Des légendes et des histoires perdurent parmi eux au sujet des Hobbits des rivières de Havrebrume, mais quand on est au service de l'Ennemi, il n'y a guère de temps pour discuter de telles futilités."; };
[1879468719] = {["ID"] = 1879468719; ["i"] = 5; ["j"] = 2; ["k"] = 60; ["TYPE"] = 4; ["CRV"] = "Race"; ["SUBTYPE"] = 125; ["LP"] = 5; ["MIN_LVL"] = 19; ["NAME"] = "Ennemi / Ennemie des Orques et gobelins"; ["LORE"] = "Élevés par l'Ennemi pour la guerre, les Orques sont plus grands et plus robustes que leurs cousins gobelins, mais leurs origines sont les mêmes. Aux yeux des Hobbits des rivières de Havrebrume, peu des choses les distinguent. Belliqueux et brutaux, les Orques et les gobelins ont un certain talent pour le travail du bois et du métal, dont ils se servent uniquement pour la construction d'armes et de machines de guerre."; };
[1879468766] = {["ID"] = 1879468766; ["i"] = 5; ["j"] = 2; ["k"] = 61; ["TYPE"] = 7; ["CRV"] = "Race"; ["SUBTYPE"] = 125; ["LP"] = 5; ["MIN_LVL"] = 25; ["NAME"] = "Ami / Amie des Oubliés"; ["LORE"] = "Vous avez réussi à vous lier d'amitié avec les Eglain, des hommes qui ont renoncé à beaucoup de choses et choisi une vie difficile dans les Terres Solitaires. Bien qu'ils occupent des terres moins hospitalières que les Puits du Long Fleuve, leur mode de vie et leur amitié avec Radagast le Brun vous ont amenés à les considérer comme des alliés des Hobbits des rivières de Havrebrume."; ["TITLE"] = "Coureur / Coureuse des ruisselets"; };
[1879468771] = {["ID"] = 1879468771; ["i"] = 5; ["j"] = 2; ["k"] = 62; ["TYPE"] = 6; ["CRV"] = "Race"; ["SUBTYPE"] = 125; ["LP"] = 10; ["MIN_LVL"] = 125; ["NAME"] = "Retour en terre connue"; ["LORE"] = "Rares sont les Hobbits des rivières de Havrebrume qui ont voyagé aussi loin que vous, mais même après toutes vos aventures, peu de choses vous apporteraient plus de réconfort que de retourner à Havrebrume."; ["TITLE"] = "Dompteur / Domptrice des vagues"; };
